(4908, '3370007922045782630', 'gojekindonesia', 13, 'https://www.instagram.com/p/C7ErFmbyopm/', 'Selalu #BerjuangUntukIndonesia! \n\nSemangat GoTo buat memajukan UMKM Indonesia tercermin dalam dukungan di acara ✨HUT ke-44 Dekranas✨\n\nGoTo melalui Gojek menghadirkan 20 mitra usaha kuliner legendaris GoFood di Solo agar ragam UMKM kuliner indonesia semakin dikenal luas💚 Komitmen GoTo juga sejalan dengan misi Dekranas yang terus mendukung kemandirian ekonomi Indonesia.\n\nSemangat terus UMKM Indonesia!\n\n#PastiAdaJalan\n', 5904, '2024-05-17 14:32:41', 0.00479745, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3370007922045782630', 229, 1, 6604),
(4910, '3369161927086602134', 'gojekindonesia', 13, 'https://www.instagram.com/p/C7BquwOxHeW/', '[#GIVEAWAYGOJEK]\nMimin udah siapin hadiah nih gaes kalau nilai kamu di atas KKM~ ✨\n\nCaranya gini nih:\n\n1. Tulis kode promo dan harga setelah memakai kode promo di kolom komentar, sertakan hashtag #PakeGojekPalingHemat\n2. Pastikan akun kamu tidak di-private dan follow @gojekindonesia\n3. Kamu boleh jawab lebih dari satu kali\n4. 1 orang beruntung dapet smartphone senilai 5juta dan 7 orang beruntung lainnya dapet GoPay masing-masing 250ribu\n5. Periode kuis 16 - 25 Mei 2024\n6. Pemenang akan diumumin tanggal 31 Mei 2024 di IG Story dan Twitter @gojekindonesia\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan lebih dahulu\n8. Keputusan juri tidak dapat diganggu gugat\n\nSemoga kamu lulus ya gaes! 💯\n', 6143, '2024-05-16 10:30:21', 0.0220575, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3369161927086602134', 22055, 0, NULL),
(4911, '3369047251694265026', 'gojekindonesia', 13, 'https://www.instagram.com/p/C7BQqAcviLC/', 'ANTI GUBRAK-GUBRAK 😎\n\nBelanja di GoMart lebih praktis dan #PastiDapetDiskon s.d 8ribu! Tinggal duduk manis, belanjaan kamu bisa sampai dalam 30 menit~\n\nYuk, langganan #GojekPLUS sekarang! Mulai dari 6ribuan bisa hemat di setiap transaksi sampai 24 juta ❤\n', 1600, '2024-05-16 06:42:50', 0.00130712, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3369047251694265026', 71, 1, 31339),
(4912, '3368362853110509107', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6-1CsmRe4z/', 'Kalo urusan hemat ada aja momen keinget emak! Apalagi urusan buat berangkat kantor, udah pasti emak nyaranin pake GoCar Hemat!\n\nNaik GoCar Hemat mulai dari 6ribu siap nganterin kamu kerja, ngantor, sampe jalan-jalan sama pacar ❤\n\nKamu udah cobain GoCar Hemat belum?\n\n#PakeGojekPalingHemat\n', 738, '2024-05-15 08:03:28', 0.000635958, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3368362853110509107', 75, 1, 2693),
(4914, '3366282205151876848', 'gojekindonesia', 13, 'https://www.instagram.com/p/C63b9SLy9bw/', 'Bibir dikulum\nBikin heboh\nAssalamualaikum \nEBL ENAK BGT LOHHHH\n\nEnak banget bisa GoFood-in makanan yang #PastiDapetDiskon di tiap transaksi karena udah langganan #GojekPLUS~ kamu bisa dapet potongan harga s.d 12 ribu lochh! Ga cuma GoFood aja, kamu bisa hemat di tiap transaksi buat pake GoRide, GoCar, GoTransit, GoSend dan GoMart juga 🥰🥰\n\nJadi, mending langsung langganan Gojek PLUS sekarang juga dechhh! 💚\n', 883, '2024-05-12 11:09:51', 0.000795534, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3366282205151876848', 134, 1, 18656),
(4915, '3365477845047725875', 'gojekindonesia', 13, 'https://www.instagram.com/p/C60lETdhE8z/', 'JOGET - JOGET SAMPE KEPLESET!\n\nTernyata karena kesenengan udah langganan #GojekPLUS yang #PastiDapetDiskon kalo mau pake GoTransit ✂️✨\n\nYuk, langganan sekarang biar lebih satset + hemat naik GoRide & beli tiket KRL langsung! 💚\n', 732, '2024-05-11 08:32:03', 0.00065786, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3365477845047725875', 109, 1, 7053),
(4916, '3365383274477588530', 'gojekindonesia', 13, 'https://www.instagram.com/p/C60PkHwRxAy/', 'Lahir di Indonesia, dari tangan anak Indonesia, dan dipersembahkan bagi masyarakat Indonesia💚\n\nSemangat Gojek, karya anak bangsa yang #BerjuangUntukIndonesia, dirayakan dalam acara ✨Mega Kopdar Halalbihalal Mitra Gojek Senusantara✨\n\nAcara ini salah satu bentuk apresiasi bagi para Mitra Driver Gojek yang terus  berjuang memberikan yang terbaik bagi pelanggan dan keluarga, serta turut serta mendukung kemajuan Bangsa.\n\nHabib Ja’far @husein_hadar turut hadir memberikan dakwah menyejukkan bagi  ratusan ribu mitra Gojek dari Sabang sampai Merauke yang bergabung secara online maupun offline~ \n\nBanyak dari mereka yang juga berhasil ngantongin beragam hadiah menarik, lho.\n\nSelalu menyala Mitra Driver Gojek, #PastiAdaJalan!\n', 6953, '2024-05-11 05:23:50', 0.00561645, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3365383274477588530', 227, 1, 25298),
(4917, '3364854951137021692', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6yXcATPI78/', 'Frugal living sama pelit sama diri sendiri tuh beda banget ya! kita harus cerdas dalam mengelola keuangan. salah satunya adalah mencari diskonan dan GojekPlus bisa jadi solusinya! langganan sekarang pasti dapat diskon sampe 12 ribu setiap pesan GoRide, GoFood, GoTransit, dan banyak lagi! buka aplikasi Gojek kamu dan langganan Gojek Plus di halaman My Subcription!\n\n#GojekPLUS #PastiAdaDiskon\n', 497, '2024-05-10 11:54:49', 0.000396594, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3364854951137021692', 10, 1, 4163),
(4918, '3364776955102067215', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6yFtA1R3oP/', 'Ngajak pacar gak perlu berdebat kalo butuh yang lebih nyaman~\n\nGoCar Comfort siap nemenin dan kasih diskon yang bikin kamu hemat s.d 30ribu pake promo GOCARAJA dan kenyamanan lebih di perjalanan kamu bareng pacar✨\n\nCoba tag si pacar yang susah banget diajak jalan?😭\n', 598, '2024-05-10 09:19:08', 0.000513929, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3364776955102067215', 59, 1, 6703),
