(4920, '3363439490726394464', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6tVmWERHpg/', 'EladalahAHAHAHAHA ketarik ke planet~\n\nBukan sembarang planet, tapi planet sembarang bukan. Gak ngerti kan?\n\nKalo enggak ngerti coba tonton lagi supaya kamu ngerti cara langganan #GojekPLUS, kamu #PastiDapetDiskon di SETIAP TRANSAKSI!\n', 693, '2024-05-08 13:00:00', 0.000642998, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3363439490726394464', 129, 1, 7280),
(4921, '3363398862691918084', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6tMXIQtGEE/', 'Apapun love languagenya,\nGoCar Comfort kenyamanannya✨\n\nAjak pacar, gebetan, atau temen buat jalan-jalan dan kasih kenyamanan lebih naik GoCar Comfort! Kamu udah pernah coba GoCar Comfort belum?\n', 530, '2024-05-08 11:40:13', 0.000438834, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3363398862691918084', 31, 0, NULL);
