(4924, '3362699220892302438', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6qtSADxLxm/', 'Keliatan banget nih kembarnya, potongan rambutnya aja sama 🥳\n\nYang 1 pake potongan gondrong, yang 1 pake POTONGAN dari Gojek PLUS! Bayar mulai dari 6 ribuan, hemat sampai jutaan~ ✨\n\n#GojekPLUS #PastiDapetDiskon\n', 632, '2024-05-07 13:00:00', 0.000540525, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3362699220892302438', 59, 1, 5212),
(4925, '3362677531991162066', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6qoWYshTzS/', 'Mention temen kamu yang bilangnya otw tapi masih rebahan... Semoga harinya senin terus🙏🏻\n\nKalo yang bilangnya otw tapi ternyata lagi ngehemat, kasih tau sekarang ada Gojek PLUS! Paket langganan yang bisa bikin kamu hemat mau kesana kemari pake GoRide s.d 8 RIBU✨\n\nTunggu apa lagi? Langganan sekarang yang #PastiDapetDiskon! 💚\n', 488, '2024-05-07 11:47:37', 0.000404416, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3362677531991162066', 29, 1, 2755),
