(4927, '3361884392938410801', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6n0AsZBhMx/', 'JINJA?? Pake Gojek PLUS bisa hemat di setiap transaksi?\n\nAigoooo, langganan mulai dari 6ribuan aja kamu udah #PastiDapetDiskon s.d 12 ribu di setiap transaksi yang bikin kamu makin hemat mat mat 😱\n\nYuk, langganan #GojekPLUS sekarang! 💚\n', 655, '2024-05-06 09:32:28', 0.000567121, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3361884392938410801', 70, 1, 12445),
