(4933, '3357605519442614987', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6YnG46RJrL/', '[#GIVEAWAYGOJEK]\nHhmm… Jawaban yang bener, yang mana ya?🤔\nBuruan tulis, siapa tau kamu dapetin hadiah~ \nGini caranya:\n\n1. Tulis jawaban di kolom komentar dengan format: [Jawaban yang benar], [Kode promo GoCar] & mention 2 temen kamu\n2. Sertakan hashtag #PakeGojekPalingHemat\n3. Pastikan akun kamu tidak di-private dan follow @gojekindonesia\n4. Kamu boleh jawab lebih dari satu kali\n5. 1 orang beruntung dapet smartphone senilai 5juta dan 7 orang beruntung lainnya dapet GoPay masing-masing 250ribu\n6. Periode kuis 30 April - 9 Mei 2024\n7. Pemenang akan diumumin tanggal 15 Mei 2024 di IG Story & X Gojek Indonesia\n8. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan lebih dahulu\n9. Keputusan juri tidak dapat diganggu gugat\n\nMimin tunggu jawaban kamu~\n', 3448, '2024-04-30 11:49:50', 0.0119964, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3357605519442614987', 11888, 0, NULL),
(4934, '3357531339879732677', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6YWPbzxdXF/', 'Selain persiapan di atas, aku mau ingetin lagi kalo pulang kantor pake GoTransit ada diskon GOSTASIUN s.d 90%! 🤩\n\nPulang kantor langsung ke rumah atau lanjut nongkrong nih?? Coba komen dong~\n\n#PakeGojekPalingHemat\n', 841, '2024-04-30 09:22:27', 0.000712617, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3357531339879732677', 70, 0, NULL),
