(4940, '3355456830259486892', 'gojekindonesia', 13, 'https://www.instagram.com/p/C6Q-jWKxmCs/', 'Semangat gotong royong yang dimiliki oleh Gojek, berhasil melahirkan invoasi terbaru! Kenalin:\n\n✨Integrasi GoTransit Solo-Jogja✨\n\nMempermudah kegiatan mobilitas Kastamer di wilayah Solo-Jogja💚 Inovasi terbaru dari Gojek ini diluncurkan oleh Presiden Unit Bisnis On-Demand Service GoTo (Gojek) bersama @bhresudjiwo, Kadishub Kota Surakarta (Mewakili Walikota Surakarta), PT. KCI, dan PT. KAI.\n\n𝘚𝘦𝘱𝘪 𝘪𝘯𝘨 𝘱𝘢𝘮𝘳𝘪𝘩, 𝘳𝘢𝘮𝘦 𝘪𝘯𝘨 𝘨𝘢𝘸𝘦, 𝘣𝘢𝘯𝘵𝘦𝘳 𝘵𝘢𝘯 𝘮𝘣𝘭𝘢𝘯𝘤𝘢𝘯𝘨𝘪, 𝘥𝘩𝘶𝘸𝘶𝘳 𝘵𝘢𝘯 𝘯𝘶𝘯𝘨𝘬𝘶𝘭𝘪.\n\n#PastiAdaJalan\n', 13034, '2024-04-27 12:42:47', 0.0106877, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3355456830259486892', 629, 1, 52911),
