(5017, '3256829025519613270', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0ylL5IRzVW/', 'Jadi gini wir~\nKalo susah misahin trip pribadi sama trip bisnis bisa pake Profil Bisnis aja🤭\n\nSemua trip kepisah, reimburse jadi gampang~~\nSiapa yang udah aktifin Profil Bisnis Gojek?\n', 1025, '2023-12-13 10:45:25', 0.00106932, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3256829025519613270', 342, 1, 12518),
(5018, '3255365407259170538', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0tYZcZxxbq/', 'Kenalin Dzikru Rahman, salah satu anak mitra driver yang menjadi wisudawan Beasiswa Gojek.\nPada tahun 2020 lalu, setelah melalui berbagai tahap seleksi, Dzikru resmi tercatat sebagai mahasiswa jurusan Teknik Mesin, Politeknik Negeri Jakarta.\n\nSetelah 3 tahun, Dzikru berhasil menyelesaikan kuliahnya dengan predikat Cum Laude💚\nDzikru juga berhasil diterima di salah satu perusahaan terkemuka di Indonesia.\n\nTahun ini, Beasiswa Gojek kembali memberikan biaya kuliah gratis buat putra-putri mitra driver Gojek se-Indonesia yang telah berhasil melewati seleksi ketat. Program Beasiswa Gojek dapat terlaksana salah satunya juga tidak lepas dari dukungan para pelanggan setia Gojek selama ini.\n', 2932, '2023-12-11 10:17:32', 0.00259702, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3255365407259170538', 388, 1, 49330),
(5019, '3251792236253555109', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0gr89lRCml/', 'Manusia berjalan berdampingan. Untuk bisa melengkapi, kita perlu saling memberi. Cerita Gojek selanjutnya menghadirkan Bu Linda dan Pak Fahrul. Bu Linda pernah membantu seorang Mbah sebagai customer-nya. Di lain sisi, kegigihan Pak Fahrul dalam menjadi mitra driver Gojek diapresiasi lebih oleh customer dari Republik Chili. Berkat kebaikan Bu Linda dan kegigihan Pak Fahrul, keduanya ramai diperbincangkan di media sosial dan dinobatkan sebagai Driver Jempolan. Saksikan cerita mereka di video ini!\n\nKalau kamu punya Cerita Gojek yang bermakna, kirimkan ke bit.ly/shareCeritaGojek.\n\n#CeritaGojek #DriverJempolan\n', 3806, '2023-12-06 12:00:12', 0.0032322, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3251792236253555109', 326, 1, 49780),
(5020, '3250312675242454600', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0bbihAxq5I/', 'Malah dijadiin bahan bersyukur🙏🏻\nPadahal mah lagi nunggu Abang GoRide~\n\nGaes~ Gaes~\nMimin cuma mau ingetin kalo ada kode promo GORIDEAJA yang bikin kamu LEBIH HEMAT kalo mau naik GoRide🛵💨\n\nTag temen kamu yang wajib tau kode promo ini!\n', 1180, '2023-12-04 10:58:34', 0.00111703, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3250312675242454600', 248, 1, 13338),
(5021, '3247442548700421876', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0RO8rXxx70/', 'Setiap manusia mengarungi perjalanannya masing-masing. Tidak jarang, perjalanan itu menjadi makin bermakna bersama mitra driver Gojek. Kita diingatkan kembali tentang arti keikhlasan dan hal-hal kecil yang tidak bisa ditakar dengan materi, seperti cerita Pak Maryono dan Pak Soleh. Pak Maryono membuat program Jumat Berkah dan membuat salah satu customer-nya tersentuh. Lalu, Pak Soleh pernah membantu seorang customer yang sedang sakit dengan upaya yang sederhana, tetapi bernilai adanya. Sebagai Driver Jempolan, keduanya menceritakan perjalanan mereka di video ini. Simak selengkapnya!\n\nKalau kamu punya Cerita Gojek yang bermakna, kirimkan ke bit.ly/shareCeritaGojek.\n\n#CeritaGojek #DriverJempolan\n', 3789, '2023-11-30 12:00:08', 0.00321734, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3247442548700421876', 324, 1, 27905),
(5022, '3247377204924381126', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0RAFzPN_fG/', 'Ehem... ehem...\nSiapa yang tiap kali pindah tempat nongkrong jadi kayak si mas di atas🤭\n\nKalo sekarang sih, kamu bisa pake GoCar Hemat yang MULAI DARI 10 RIBU, gaes.\nSelain hemat, kamu juga bakal tetap slaaaay~\n\nTag temen kamu yang dalam sehari bisa pindah tempat nongkrong sampe 3 kali!\n', 1106, '2023-11-30 09:46:08', 0.000949634, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3247377204924381126', 108, 1, 10760),
(5023, '3245234306866956882', 'gojekindonesia', 13, 'https://www.instagram.com/p/C0JY2h5t0pS/', 'Emang ya orang yang pengertian dan bikin tenang selalu datang tak terduga, kayak pengalaman dari kak @oktav2101 di atas🥹\n\nSiapa yang pernah ketemu sama Abang Gojek pengertian juga? Coba bagiin #CeritaGojek kamu di kolom komentar dong, gaes~\n', 1277, '2023-11-27 10:48:38', 0.00125001, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3245234306866956882', 321, 1, 15051),
(5024, '3242311509479864249', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cz_ASOttTe5/', 'Sepenggal kisah dari Rang… enggak yang mau ke bandara.\n\nCinta langsung sat set nyamperin dan nyaranin pake GoCar terus masukin kode promo GOBANDARA, diskon sampe 140 RIBU jadi lebih HEMAT😱\n\nTag temen kamu yang mau pergi ke Bandara kayak Rangga!\n', 1401, '2023-11-23 10:01:37', 0.00129538, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3242311509479864249', 255, 1, 19203),
(5025, '3240939182620167513', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cz6IQPuuE1Z/', '[GIVEAWAY]\nGojek bagi-bagi hadiah lagi🥳\n\nYuk, jawab tebak-tebakan di atas soalnya kamu bisa menangin total hadiah senilai Rp7.000.000!\nGini cara ikutannya:\n\n1. Pastikan akun kamu tidak di-private dan follow @gojekindonesia\n2. Tebak dan tulis jawaban yang tepat di kolom komentar\n3. Kamu boleh jawab lebih dari satu kali\n4. 1 orang beruntung dapet hape senilai 5 juta dan 4 orang beruntung lainnya dapet GoPay masing-masing 500 ribu\n5. Periode kuis 21 November - 5 Desember 2023\n6. Pemenang akan diumumin tanggal 12 Desember 2023 di IG Story, Twitter, dan FB @gojekindonesia\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan lebih dahulu\n8. Keputusan juri tidak dapat diganggu gugat\n\nCek clue-nya, tebak gambarnya, tulis jawabannya, dan menangin hadiahnya🎁\n', 7027, '2023-11-21 12:34:45', 0.0439249, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3240939182620167513', 49126, 0, NULL),
(5027, '3237261320738142579', 'gojekindonesia', 13, 'https://www.instagram.com/p/CztEAT7tXlz/', 'Sevvuah pencerahan dari SUHU🙏🏻\nKalo mau otw kantor bisa langsung gas pake\n\n✨GoRide Transit✨\n\nLebih praktis, gak worry kalo ketinggalan kartu~\nPake juga kode promo GOSTASIUN buat dapet diskon sampe 90%!\n\nTag temen kamu yang harus pake GoRide Transit🤭\n', 1556, '2023-11-16 10:47:48', 0.00141976, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3237261320738142579', 259, 1, 19126),
(5029, '3231264334256878295', 'gojekindonesia', 13, 'https://www.instagram.com/p/CzXwcrCxTLX/', 'Selain naik gaji, naik jabatan juga enak sih tapi...\n\nNaik GoCar Hemat juga gak kalah enak~ Mulai dari Rp10 ribu aja, kamu bisa jalan-jalan sampe cafe hopping, gaes. Mobilnya ekonomis tapi tetep nyaman dan gak kepanasan🤭\n\nYuk, cobain GoCar Hemat biar isi dompet gak kelabakan, hati jadi lebih aman ✨\n', 1598, '2023-11-08 04:12:30', 0.00143697, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3231264334256878295', 239, 0, NULL);
INSERT INTO `posts` (`id`, `post_id`, `username`, `profile_id`, `post_url`, `caption`, `likes`, `date_posted`, `engagement`, `local_download_directory`, `comments`, `is_video`, `video_views`) VALUES
(5030, '3224233362038588117', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cy-xyj5RgLV/', '✨Jaket, lambang gotong royong Anak Bangsa✨\n\nLahir dan tumbuh di Indonesia, Gojek, @tokopedia, @gopayindonesia dan @jadijago selalu berusaha buat terus berinovasi untuk memudahkan setiap aktivitas Kastamer setia. \n\nTahun ini jadi saksi baru dari kolaborasi empat Karya Anak Bangsa, satu jaket terbaru telah hadir hasil dari gotong royong, kebersamaan dan semangat untuk memajukan Indonesia💚\n\nSiap-siap buat ketemu para Mitra Driver dengan jaket terbarunya!\n', 2886, '2023-10-29 11:25:02', 0.00321342, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3224233362038588117', 1222, 1, 42913),
(5031, '3223540491774298292', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cy8UP-LS4i0/', 'A DAY IN A LIFE BARENG GORIDE TRANSIT dan @abdurarsyad.\n\nBuat yang belum tau, Bang Abdur ini punya KONTRAS, Konten Transportasi yang selalu ngerangkum ongkos dia pergi seharian. \n\nKali ini dia nyobain GoRide Transit, mulai dari rumah sampe tempat tujuan cuma sekali pesan. Praktis, mudah dan pastinya LEBIH HEMAT.\n\nMau tau seberapa hemat ongkos transportasi yang Bang Abdur keluarin? Tonton videonya sampe habis!\n', 1463, '2023-10-28 12:31:31', 0.00123437, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3223540491774298292', 115, 1, 14139),
(5032, '3221326886039436764', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cy0c7xLy73c/', 'Yang cakep tuh kalau udah gabingung lagi soal urusan pisahin trip pribadi dan reimbursement kantor, karena pake Profil Bisnis Gojek. Praktis tinggal download laporan perjalanannya deh.\n', 1280, '2023-10-25 11:08:57', 0.00118509, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3221326886039436764', 235, 1, 12901),
(5033, '3220575158405179262', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyxyAsRMCd-/', 'Pepatah pernah bilang sedia payung sebelum hujan, sama kaya kalo lagi cafe hopping harus sedia GoCar Hemat sebelum berangkat. \n\nSekarang udah gaperlu pusing tujuh keliling karena ada GoCar Hemat, mobilnya ekonomis, mulai dari 10rb bisa pindah coffee shop sampai jarak maks. 10 km.\n', 1240, '2023-10-24 10:15:12', 0.00108809, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3220575158405179262', 151, 1, 17289),
(5034, '3217597896967575918', 'gojekindonesia', 13, 'https://www.instagram.com/p/CynND1ey9lu/', '#CeritaGojek kali ini lanjutan cerita tentang Pak Gusti, seorang Driver Jempolan yang inspiratif atas inisiatif yang beliau lakukan. Tonton video dari kastamer Gojek yang bertemu Pak Gusti sampai habis ya ges👍🏻\n\nKamu pun bisa berbagi dan menulis Cerita Gojek yang kamu alami di bit.ly/shareCeritaGojek dan dapatkan hadiah dengan total GoPay 1juta bagi cerita yang terpilih✨\n', 1488, '2023-10-20 07:40:06', 0.00141585, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3217597896967575918', 322, 1, 14678),
(5035, '3216926140451709074', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cyk0UfeSuCS/', 'Ke bandara masih harus nyetir? Pengen bebas khawatir tanpa banyak mikir? Tinggal pake kode promo GOBANDARA, diskon sampai 140rb, GoCar & GoCar Instant. Ke bandara udah gaperlu merana. #PastiAdaJalan~\n', 1070, '2023-10-19 09:25:27', 0.000933989, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3216926140451709074', 124, 1, 10262),
(5037, '3212618544222610235', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyVg4t3OKM7/', 'Pertama di dunia!\n\nGoRide Transit resmi diluncurkan 🎉🎉🎉\n\nLayanan multimoda yang bisa memudahkan kamu pergi ke kantor atau pun mau jalan-jalan. Praktis, nyaman dan hemat!\n\nYuk, cobain sekarang! Jangan lupa masukin kode promo GOSTASIUN sebelum kehabisan, dapet diskon sampe 90%.\n', 2573, '2023-10-13 10:46:55', 0.00241867, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3212618544222610235', 519, 1, 63944),
(5038, '3211911328617347499', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyTAFYASjmr/', 'Baru, GoCar Comfort buat kamu yang mau ekstra care dan ekstra nyaman di perjalanan!\n\nBisa hemat juga pake kode promo GOCARAJA, diskon sampe 30rb. \n\nTersedia di Jabodetabek, Bandung, Semarang, Yogyakarta, Solo, Medan, Palembang, Makassar, Bali, Batam, Surabaya, dan Malang.\n', 996, '2023-10-12 11:22:01', 0.000848726, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3211911328617347499', 89, 1, 10359),
(5039, '3211095698716411112', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyQGoZdxsTo/', 'PETUALANGAN OTW NGANTOR\n\nIya, ngantor, jangan sampe perjalananmu kayak mau mencuri harta karun ya. Pake GoRide Transit tinggal sekali pesen, transportasinya udah diaturin. Mulai dari pesen GoRide dari rumah, tiket commuter line, sampe pesen GoRide lagi ke kantor. Lebih mudah, cepat dan hemat.\n\nApalagi pake kode promo GOSTASIUN~\n', 1146, '2023-10-11 08:21:43', 0.000986399, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3211095698716411112', 115, 1, 11191),
(5040, '3209669323971568130', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyLCT6dyyIC/', 'Pernah gasih kalian nongkrong ke suatu tempat, eh tapi mau pindah lagi ketempat lain? \n\nTenang, sekarang cari tempat nongkrong bisa hemat banget pake GoRide yang ngasih diskon sampe 30rb pake kode promo GORIDEAJA. Kalo mau GoCar juga bisa, pake kode promo GOCARAJA, dapet diskon sampe 30rb!\n', 1083, '2023-10-09 09:08:25', 0.000953545, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3209669323971568130', 136, 1, 10118),
(5041, '3208174056901336540', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyFuU6fOl3c/', 'Kalo kamu nyari yang ganteng, aku mundur\nKalo kamu nyari yang lebar dan nyaman, ada GoRide Comfort\nTapi kalo kamu nyari yang bisa GIVEAWAY hadiah total 8 juta, aku maju paling depan!\n\nYuk, tebak gambar di atas dan tulis jawaban kamu di kolom komentar ya. Jangan lupa, ikutin juga syarat-syarat di bawah ini.\n\nNih, syaratnya:\n1. Pastikan akun kamu tidak diprivate dan follow @gojekindonesia\n2. Isi kotak yang kosong dengan jawaban yang tepat sesuai dengan gambar\n3. Kamu boleh jawab lebih dari satu kali.\n4. Menangin total hadiah senilai Rp 8.000.000\n5. Periode kuis 7-31 Oktober 2023\n6. Pemenang akan diumumin tanggal 6 November 2023 di IG Story, Twitter, dan FB @gojekindonesia\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan lebih dahulu\n8. Keputusan juri tidak dapat diganggu gugat\n\nP.S.: Hadiahnya emang beneran buat kamu, makanya yuk ikutan!\n', 5489, '2023-10-07 07:36:17', 0.0326638, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3208174056901336540', 36268, 0, NULL),
(5043, '3206762123154206290', 'gojekindonesia', 13, 'https://www.instagram.com/p/CyAtSktyK5S/', 'Giliran punya ayank pengertian, eh malah cuaca yang gak pengertian. Tiba-tiba panas, tiba-tiba hujan.\n\nUntung ada GoCar Hemat! Mobilnya ekonomis, harganya gak bikin kantong meringis. Mulai dari Rp10rb aja kamu udah bisa hang out sama temen sampe keliling-keliling coffee shop. Lebih hemat lebih sat-set!\n', 1193, '2023-10-05 08:50:56', 0.00101769, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3206762123154206290', 108, 0, NULL),
(5044, '3204608782201703510', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cx5DrVrOsxW/', 'MOHON PERHATIAN📢\nPengundian hadiah periode 2 bakal dilakuin di 4 Oktober 2023!\n\nJangan lupa catet waktu dan tanggalnya ya, gaes🤩\n#PastiAdaJalan\n\n*Ada hadiah GoPay total 1 juta Rupiah buat 10 orang yang jawab pertanyaan kuis di live pengundian kedua!\n', 4563, '2023-10-02 09:32:41', 0.00417714, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3204608782201703510', 777, 0, NULL),
(5045, '3200794041332125277', 'gojekindonesia', 13, 'https://www.instagram.com/p/CxrgTjYyc5d/', 'Mau tetep skena tapi gamau dompet sengsara? Tenang, dari satu tempat ketempat yang lain sekarang bisa pake GoCar Hemat, mulai dari 10rb dengan jarak maksimal 10km, pake mobil ekonomis biar instastory semakin manis~\n', 1315, '2023-09-27 03:13:50', 0.00122655, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3200794041332125277', 253, 1, 30251),
(5047, '3198021720951481902', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cxhp8-1S-Yu/', 'Salah tingkah di tempat kerja emang bikin bingung, tapi kalo GoRide Comfort gak mungkin salah, karena jok lebih lebar, lebih nyaman, hemat sampai 30rb, pakai kode promo GORIDEAJA biar tambah bahagia.\n', 1387, '2023-09-23 07:28:45', 0.00116944, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3198021720951481902', 108, 1, 53576),
(5048, '3197279870636503490', 'gojekindonesia', 13, 'https://www.instagram.com/p/CxfBRo4y7HC/', 'Tadinya kalau udah dia yang minta aku iya-iya aja deh walaupun bingung. Tapi semenjak nemu yang hemat banget udah gak bingung lagi karena ada kode promo GORIDEAJA, diskon s.d 30rb!💫\n', 1173, '2023-09-22 06:52:34', 0.000964497, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3197279870636503490', 60, 1, 28266),
(5049, '3196737478208356670', 'gojekindonesia', 13, 'https://www.instagram.com/p/CxdF8ykyYE-/', 'Bukan cuma tempe goreng yang banyak remah-remahnya, tapi reimburse-an juga. Bayangin, repot banget gak sih kalo harus terus-terusan misahin trip bisnis sama trip pribadi?\n\nMakanya, aktifin Profil Bisnis sekarang! Dapetin laporan perjalanan secara otomatis. Reimburse ke kantor jadi lebih mudah!\n', 1353, '2023-09-21 12:53:45', 0.00111547, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3196737478208356670', 73, 0, NULL),
(5050, '3195269887873434582', 'gojekindonesia', 13, 'https://www.instagram.com/p/CxX4QikMsPW/', '🥳ADA TAMBAHAN HADIAH🥳\nBuat yang belum kebagian hadiah di Undian Gojek periode 1, Mimin mau ngasih tambahan nih~\n\nGini caranya: \n1. Pastiin akun kamu gak diprivate\n2. Jawab pertanyaan di atas dengan format: [JAWABAN + CERITA KAMU], hashtag #PastiAdaJalan dan mention 3 temen\n3. Tulis jawaban dan cerita di kolom komentar\n4. 2 orang beruntung akan dapet masing-masing 1gr Emas dan 10 orang beruntung dapet masing-masing GoPay Rp100ribu!\n5. Periode kuis 19-26 September 2023\n6. Pemenang akan diumumkan tanggal 28 September 2023 di IG Story\n7. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan terlebih dahulu⁣⁣\n8. Keputusan juri tidak dapat diganggu gugat⁣⁣⁣\n\nMimin tunggu jawaban dan cerita kamu, ya!\n', 4000, '2023-09-19 12:17:58', 0.00536301, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3195269887873434582', 2856, 0, NULL),
