(5081, '3146449540853690802', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cuqby_SRnGy/', '🚨[#GIVEAWAY]🚨\n\nANAK BASKET KUMPUL SINI!\nMimin punya banyak hadiah buat kamu si ABAS, alias Anak BASket⛹🏻\n\nGini caranya:\n1. Pastiin akun kamu gak diprivate\n2. Jawab pertanyaan di atas dengan format: [JAWABAN KAMU], hashtag #GojekxIBL, domisili-mu dan mention 3 temen\n3. Tulis jawaban di kolom komentar \n4. Boleh jawab sebanyak-banyaknya\n5. 1 orang beruntung akan dapet 2 tiket VIP final + 2 jersey, 2 orang beruntung akan dapet 2 tiket tribune final + 1 jersey, dan 6 orang beruntung lainnya akan dapet official merchandise \n6. Periode kuis 14-18 Juli 2023\n7. Pemenang akan diumumkan tanggal 19 Juli 2023 di IG Story\n8. Pemenang terpilih HANYA akan dihubungi melalui DM Gojek Indonesia\n9. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan terlebih dahulu⁣⁣\n10. Keputusan juri tidak dapat diganggu gugat⁣⁣⁣\n\nMimin tunggu jawaban kamu, ya!🤩\n', 1369, '2023-07-14 03:40:36', 0.00152301, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3146449540853690802', 578, 0, NULL),
