(5083, '3140068263035679847', 'gojekindonesia', 13, 'https://www.instagram.com/p/CuTw3LMuDRn/', 'HAH?! GRATIS?!\n\n✨G R A T I S✨\n\nSikat menu favorit sekitar kamu dengan promo Rabu Gratis dari Mode Hemat! Tinggal pilih makanan yang kamu mau, terus pake Mode Hemat biar langsung nikmatin GRATIS ongkirnya🤤🫶🏻\n\nKira-kira mau jajan apa hari ini, GoFoodies?🤔\n', 1507, '2023-07-05 08:23:37', 0.00126018, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3140068263035679847', 104, 1, 17678),
(5084, '3139369141990938215', 'gojekindonesia', 13, 'https://www.instagram.com/p/CuRR5n_MVZn/', 'Bersama Gojek, yuk ciptakan ruang aman dari kekerasan seksual!\n\nKeamanan serta kenyamanan Kastamer dan Mitra jadi prioritas utama bagi Gojek. Berbagai inovasi teknologi serta pembekalan menyeluruh pun terus dibuat untuk menjamin keamanan serta kenyamanan dalam ekosistem Gojek.\n\nSalah satunya bekerja sama dengan organisasi Di Jalan Aman Tanpa Pelecehan (DEMAND) dengan menghadirkan SIUL dan BANTU. Sebuah panduan buat Mitra dan Kastamer biar sama-sama menjaga serta menciptakan ruang aman dari kekerasan seksual.\n\nMari ciptakan ruang #AmanBersamaGojek yang bikin tenang serta cegah dan lawan semua jenis kekerasan💚\n', 1013, '2023-07-04 09:13:47', 0.00085733, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3139369141990938215', 83, 1, 10179),
