(5105, '3071978994498640141', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cqh3J6UjZkN/', '[GIVEAWAY]\n\nLENGKAPIN KALIMATNYA, DAPETIN HADIAHNYA!\nMau hadiah total 8juta? Lesgo, ikutan dan baca baik-baik guys!\n\nCara ikutan giveaway:\n1. Pastikan akun kamu tidak diprivate dan follow @GojekIndonesia\n2. Lengkapi kalimat dengan jawaban yang benar dan sertakan hashtag #WeGotYou\nContoh:\nHari ini ketemu klien? Jangan lupa pake profil bisnis biar bisa pisahin trip bisnis dan trip pribadi. Nanti tinggal download aja buat laporan reimburse. #WeGotYou\n3. Kamu boleh jawab sebanyak-banyaknya.\n4. 7 orang pemenang dengan cerita paling menarik, berhak mendapatkan hadiah.\n5. Menangin HP senilai Rp5.000.000 untuk satu orang dan saldo GoPay masing-masing Rp500.000 untuk 6 orang.\n6. Periode kuis 2 - 12 April 2022.\n7. Pemenang akan diumumin tanggal 14 April 2023 di IG Story, Twitter, dan FB @gojekindonesia.\n8. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan terlebih dahulu⁣⁣.\n9. Keputusan juri tidak dapat diganggu gugat⁣⁣⁣.\n\nJalan-jalan di Hari Minggu, \njawabannya ditunggu~\n', 3300, '2023-04-02 09:41:00', 0.0218932, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3071978994498640141', 24688, 0, NULL),
