(5135, '3018174506736165143', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnitbkQJiEX/', '✨Dadah dan makasih 2022✨\nGojek dan @jejak_in juga pengen ucapin terima kasih buat Kastamer setia yang udah bergabung dan berkontribusi buat menciptakan hidup yang lebih ramah lingkungan💚\n\nMelalui GoGreener dan Tree Collective programs, kamu membantu kami untuk memberikan dampak positif bagi bumi, lho. Hal itu yang menjadi sumber semangat Gojek dan @jejak_in agar terus berinovasi! \n\nTerima kasih udah jadi bagian dari perjalanan ini dan mari terus sama-sama jaga bumi kita! #SavingOurTomorrow\n', 1080, '2023-01-18 04:01:00', 0.000951981, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3018174506736165143', 137, 0, NULL),
