(5138, '3014653412486215813', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnWM05sKPiF/', 'Konten yang dibuat khusus buat bapak-bapak…\nGak deng, buat semuanya juga bisa🤭\n\nKalo liat orang tersayang butuh bantuan, langsung ambil hape terus pesen kebutuhan di Gojek~ \nLebih cepet, bikin doi makin sayang💚\n\nKamu paling sering pesenin apa sih buat doi?\n', 672, '2023-01-13 07:25:39', 0.000915216, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3014653412486215813', 498, 1, 24063),
(5139, '3014021578957557122', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnT9Kg3II2C/', 'YANG 2023 MAKIN SEMANGAT NAIK LEVEL MANA SUARANYAA?\n\nDapetin cashback s.d 30ribu setiap naik level di #GoClub dengan transaksi GoFood, GoSend, GoMart, GoRide, ataupun GoCar sebanyak-banyaknya! Lesgo gaes naikin XP sekarang juga✨\n\n#ProgramLoyaltiGojek\n', 609, '2023-01-12 10:30:37', 0.000528791, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3014021578957557122', 67, 1, 11140),
(5140, '3013230583435551933', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnRJUA4BOS9/', 'Cari makan tanpa makan waktu? Solusinya ada di video ini 😉\n\n2023 anti jawab ‘terserah’ kalo ditanya ‘mau makan apa?’, karena udah pake fitur Search Bar dari GoFood! Tinggal ketik makanan kesukaan, lalu pilih dari beragam makanan #RekomendAsikGoFood yang disajikan, beres 💯 Lesgo pesen GoFood buat dapetin #PastiAdaPromo sampai 110ribu + cashback sampai 83ribu 🙌🏻\n', 1642, '2023-01-11 08:19:09', 0.00148625, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3013230583435551933', 258, 1, 16588),
(5141, '3012558427623864282', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnOwe2_oTfa/', 'Siapa yang pantas, yang bisa kuandalkan~ \n\nBukan, bukan nyanyi. Mimin mau ngasih rekomendasi kalo lagi buru-buru ngampus. Udah tau lah ya jawabannya apa. #WeGotYou guys!\n', 607, '2023-01-10 10:03:22', 0.000524098, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3012558427623864282', 63, 1, 9905),
(5142, '3011889711652436881', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnMYbwtsnuR/', '✨ CARA BIAR TENANG KALO PAKET LAGI DIKIRIM✨\n\nTarik nafas, tahan 5 menit…\n*Jangan 5 menit deng, kelamaan\n\nHembuskan…\nterus pantau paket lewat fitur Live Tracking GoSend! Kamu bakal tau posisi paket ada di mana jadi makin #AmanBersamaGojek\n\nLagi nungguin paket apa sih sekarang ges?\n', 540, '2023-01-09 11:54:30', 0.000474817, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3011889711652436881', 67, 1, 9150),
(5143, '3011112986302706316', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnJn063I3KM/', 'Siapa cepat, dia dapat✖️\nSiapa cepat, dia pake GoRide Instant! ✔️\n\n#GakPakeLama sampe tujuan, pas harus nyambung kendaraan dari stasiun. Geng anker, jangan lupa cobain ya!\n', 594, '2023-01-08 10:11:42', 0.000515493, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3011112986302706316', 65, 1, 11756),
(5144, '3011006383050099378', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnJPlo2Ioqy/', 'GAK MAU KELEWATAN CASHBACK 100%?!?\n\nLangsung aja sikat berbagai promo cashback 100% dari #GoClub yang berlaku di setiap minggu pertama awal bulan! Mulai dari Alfamart, Alfamidi, HokBen, McDonald’s, dan… banyak lagi bisa kamu cek videonya sampe abis!👍🏻\n\nBuruan kejar promonya gaes🤪\n#ProgramLoyaltiGojek\n', 581, '2023-01-08 06:40:11', 0.000486551, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3011006383050099378', 41, 1, 9357);
