(5145, '3010454526696406237', 'gojekindonesia', 13, 'https://www.instagram.com/p/CnHSHEkNLzd/', 'APAAA?\nKENAPAAA?\nDIMANAAA?\nAPANYAAA?\n\n*zoom in zoom out*\n\n#SebelumGojek kalo lagi laper terus nitip temen, kadang suka ke-skip🥹 Untung sekarang bisa sat set nge-GoFood.\n\nKalo laper tengah malem, mending mesen apa ges?\n', 585, '2023-01-07 12:23:19', 0.000497502, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3010454526696406237', 51, 1, 12342),
(5147, '3008125296154172345', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cm_AgTlItu5/', 'Suka khilaf sama jadwal kerja kalo abis libur gini. \n\n#WeGotYou guys! Untung ada fitur Jadwalin Perjalanan dari Gojek. Bisa jadwalin mulai dari 7 hari sampai 10 menit sebelum waktu perjalananmu. Lebih praktis, hemat waktu, minggu pertama ngantor nggak keki~\n', 884, '2023-01-04 07:16:37', 0.000750164, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3008125296154172345', 75, 1, 16598),
(5150, '3003918384437583873', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmwD9ruquAB/', 'Malem tahun baru kamu sendu?\nNih Mimin kasih REGOMENDASI biar jadi seru!\n\nGak perlu tahun baruan di Canggu, tinggal nonton aja di kamar kamu sambil ditemenin camilan favorit. Biar makin sat set pesen semuanya di GoMart💚\n\nUdah punya rencana tahun baru belum ges?\n', 683, '2022-12-29 11:57:23', 0.000614055, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3003918384437583873', 102, 1, 7912),
(5152, '3001573896905466188', 'gojekindonesia', 13, 'https://www.instagram.com/p/Cmnu45kIqFM/', 'Sekarang gak bertanyea-tanyea lagi kaan kenapa harus naik level di #GoClub😛\n\nBuruan kejar XP buat dapetin cashback GoPay Coins s.d 30ribu gaes! Kamu udah di level apa nih?\n\n#ProgramLoyaltiGojek\n', 863, '2022-12-26 06:19:17', 0.000768938, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\3001573896905466188', 120, 1, 10151),
(5153, '2998698788160750775', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmdhKj4t0S3/', '[GIVEAWAY]\n\nBukan cuma pantun yang bisa dibalas, di Hari Ibu ini, mari kita balas juga kasih sayang ibu dengan ngajakin liburan naik GoCar Luxe! Bisa dapet hadiah total Rp11 juta guys!\n\nCara ikutan giveaway:\n1. Pastikan akun kamu tidak diprivate dan follow @GojekIndonesia\n2. Ceritain kamu mau ngajak ibu liburan ke mana naik GoCar Luxe, sertakan hashtag #WeGotYou\nContoh:\nAku mau ajakin ibu belanja, ke salon, terus makan oyster terenak di Jakarta. Naik GoCar Luxe biar ibuku seneng karena sepanjang perjalanan super nyaman dan lega. #WeGotYou.\n3. Kamu boleh jawab sebanyak-banyaknya.\n4. 7 orang pemenang dengan cerita paling menarik, berhak mendapatkan hadiah.\n5. Menangin HP senilai Rp5.000.000 untuk satu orang dan saldo GoPay masing-masing Rp1.000.000 untuk 6 orang.\n6. Periode kuis 22-28 Desember 2022.\n7. Pemenang akan diumumin tanggal 10 Januari 2023 di IG Story, Twitter, dan FB @gojekindonesia.\n8. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan terlebih dahulu⁣⁣.\n9. Keputusan juri tidak dapat diganggu gugat⁣⁣⁣.\n\nGood luck, guys, selamat liburan bareng ibu!\n', 3157, '2022-12-22 07:06:18', 0.00748756, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2998698788160750775', 6415, 0, NULL),
(5154, '2998111510781346010', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmbbojNIcDa/', 'Video ini aku persembahkan, buat kamu dan semua orang yang pernah kesusahan trus ditolongin abang Gojek.\n\n#WeGotYou guys! Driver Gojek siap kamu andalkan di perjalanan. Punya pengalaman ditolongin di jalan? Ceritain dong.\n', 1344, '2022-12-21 11:41:28', 0.00113737, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2998111510781346010', 110, 1, 14804),
(5157, '2997222093098022117', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmYRZ0cD3Tl/', 'Cocok buat kamu pecinta film!🎬\n\nSekarang ada harta karun XXI yang bikin hepi dan jadi makin gampang buat nonton di bioskop deh! Untung banget deh jadi anak sultan di #GoClub!\n\nSpill film terbaik 2022 menurut kamu dong👇🏻\n#ProgramLoyaltiGojek\n', 873, '2022-12-20 06:12:52', 0.000714181, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2997222093098022117', 40, 1, 7794),
(5159, '2995869036500167823', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmTdwQSLyyP/', 'Niatnya bawa payung, malah bawa maung🐯\n*AIIINGGG MAUUUNGGG*\n \nEh salah gaes…\n#SebelumGojek kalo ada barang yang ketinggalan suka jadi kebingungan, akhirnya mah pasrah. Sekarang tinggal GoSend-in aja~\n\nApa sih barang yang sering banget ketinggalan?\nKasih tau di kolom komentar dong😆\n', 1112, '2022-12-18 09:24:41', 0.000923038, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2995869036500167823', 68, 1, 11840),
(5160, '2995222574319633657', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmRKw_djYT5/', 'Bisakah kamu temukan Harta karunnya? Di manaa?\n\nDi #GoClub dong udah pasti! Yuk, kejar XP sebanyak-banyaknya dan rasakan sensasi bak anak sultan dari GoClub!😍✨\n\nHarta Karun apa nih yang kalian tunggu-tunggu?\n\n#ProgramLoyaltiGojek\n', 1017, '2022-12-17 12:00:01', 0.000840903, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2995222574319633657', 58, 1, 11930),
(5161, '2995130358028029369', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmQ1zEWP825/', '🚨[#GIVEAWAY]🚨\n\nAkhir tahun tiba, Mimin BM bagi-bagi hadiah~\nGini caranya ges:\n\n1. Pastiin akun kamu gak diprivate\n2. Temuin 3 kata dan pake kata-kata itu buat ceritain pengalaman #SebelumGojek, lalu mention 3 temen \n3. Tulis di kolom komentar dan sertain hashtag #SebelumGojek\n4. Boleh jawab sebanyak-banyaknya\n5. 1 orang beruntung akan dapet Samsung A53, 2 orang beruntung akan dapet Samsung M32 & 8 orang lainnya akan dapet GoPay Rp1.200.000!\n6. Periode kuis 17 Desember - 26 Desember 2022\n7. Pemenang akan diumumkan tanggal 2 Januari 2023 di IG Story, Twitter, dan FB @gojekindonesia\n8. Pihak Gojek Indonesia berhak untuk melakukan penambahan atau pengurangan syarat dan ketentuan yang berlaku tanpa melakukan pemberitahuan terlebih dahulu⁣⁣\n9. Keputusan juri tidak dapat diganggu gugat⁣⁣⁣\n\nMimin tunggu cerita kamu, ya!🤩\n', 38222, '2022-12-17 08:56:23', 0.0355151, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2995130358028029369', 7180, 0, NULL),
(5162, '2994498471306045083', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmOmH5-paab/', 'GUYS, GUYS, ADA YANG MEVVAH TAPI NGGAK BIKIN BONCOS ✨\n\nKenalin, GoCar Luxe baru! Kalo kata @patriciagouw sih, “pas buat aku yang pengen tetep nyaman walau bawa koper yang buanyak…”\n\nSelain armadanya yang terbaik di kelasnya, dapet mitra driver pilihan, ruang duduknya juga lebih nyaman dan lega. Btw, GoCar Luxe udah beredar di beberapa wilayah di Jakarta. Kira-kira, kamu mau ajakin siapa nih buat jalan-jalan?\n', 1412, '2022-12-16 12:01:43', 0.00117022, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2994498471306045083', 84, 1, 27356),
(5163, '2994342449951200299', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmOCpfxNtQr/', 'Auto sayang pas doi minta Bagikan Perjalanan~\nBerasa aman karena doi bisa pantau keberadaan kamu di mana xixixi 🤭 #AmanBersamaGojek\n\nKasih emot 🙌🏻 di kolom komentar, kalo kamu sering pake fitur Bagikan Perjalanan!\n', 980, '2022-12-16 06:51:12', 0.00079084, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2994342449951200299', 31, 1, 15264),
(5164, '2993781452805938937', 'gojekindonesia', 13, 'https://www.instagram.com/p/CmMDF6dpp75/', 'Begini nih, kalo pikiran masih di kerjaan, tapi hati udah pengen liburan…\n\nBiar nggak ribet di jalan, udah paling bener beli tiket KRL di GoTransit gess! Modal hape aja, urusan tiket KRL aman sentosa. GoTransit bikin kamu #JalanTerus bebas hambatan!\n', 952, '2022-12-15 12:17:12', 0.000773631, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\gojekindonesia\\posts\\2993781452805938937', 37, 1, 11840),
(5165, '3358874818878184806', 'grabid', 14, 'https://www.instagram.com/p/C6dHtoIPR1m/', 'Ada naluri hemat yang bersemayam dalam diri kita semua. Udah, jangan ditahan. Keluarin aja dan gabung jadi #SobatHemat bareng Grab. Mau jalan, jajan, kirim-kirim sampai belanja, bisa lebih hemat di sini. Smart bukan sobat?\n', 4203, '2024-05-02 05:51:42', 0.00407544, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3358874818878184806', 382, 0, NULL),
(5168, '3376207752530583487', 'grabid', 14, 'https://www.instagram.com/p/C7asxAhgV-_/', 'Kalau gini caranya sih, bisa nongkrong setiap hari!\n\n@reguanggrek__ habis roller sesh di Sanur lanjut nongkrong di @stujadipantai. View mantep, makanan enak, plusssss ternyata bisa bayar pake #GrabFoodDineInDeals! Langsung diskon 20% dari total bill tanpa minimal pembayaran. Emang boleh semurah ini??? \n\n#GrabFoodDineInDeals ternyata sudah ada di banyak kota lho, seperti Jakarta, Bandung, Semarang, Makassar, Medan dan masih banyak lainnya. Mending sekarang kamu cek promonya & jangan lupa SPILL BILL #GrabFoodDineInDeals biar nongkrong terus tanpa kantong bolong! 💚\n', 233, '2024-05-26 03:51:49', 0.000241771, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3376207752530583487', 39, 1, 5722),
(5169, '3375631609683094882', 'grabid', 14, 'https://www.instagram.com/p/C7YpxBrva1i/', 'Siapa yang udah gajian? Sini sini, Mimin kasih tau biar kamu bisa tetep makan enak tapi gajian tetep awet!\n\nCaranya ya dengan #NgeGrabFood pake Voucher Dine-in! Dari resto @seriburasa_id ,@saladstopid , @rotio.indonesia sampe @soursallycoid , bisa kamu nikmatin dengan banyak diskonnya yang sampe 50%!!\n\nBuruan sat set beli vouchernya sekarang, karena promonya cuma sampe 31 Mei 2024, lho..\n\nGASSSSSS!\n', 109, '2024-05-25 08:46:45', 0.000103108, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3375631609683094882', 7, 1, 1994),
(5170, '3375496514028644338', 'grabid', 14, 'https://www.instagram.com/p/C7YLDIDPyfy/', '𝐔𝐝𝐚𝐡 𝐦𝐚𝐬𝐚𝐧𝐲𝐚 𝐤𝐚𝐥𝐨 𝐠𝐚𝐣𝐢𝐚𝐧 𝐛𝐞𝐥𝐚𝐧𝐣𝐚𝐢𝐧 𝐨𝐫𝐚𝐧𝐠𝐭𝐮𝐚 𝐠𝐚𝐞𝐬. \nBiar makin sat-set dikirim, ini nih yang gercep antar paket belanjaan abis gajian, GrabExpress instant. \n \nGak percaya? Buktiin sekarang mumpung lagi ada promo #GrabJian yang bisa bikin kamu dapet diskon ongkir s.d 14rb!\n', 192, '2024-05-25 04:17:15', 0.000188439, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3375496514028644338', 20, 1, 7296),
(5171, '3374955580647832339', 'grabid', 14, 'https://www.instagram.com/p/C7WQDglPHsT/', 'Long weekend mending di rumah aja biar bisa masak enak buat keluarga, terus pesannya lewat GrabMart! Eits, jangan lupa sekalian stok skin care dan makeup supaya cantikmu tetap paripurna dari rumah😍✨mumpung ada diskon GrabJian!\n\n30 menit pasti langsung sampe, semua serba beku dan segar! Ada diskon spesial hingga 50ribu hanya dari 23 - 31 Mei 2024, lho! Buruan pesen di GrabMart supaya #CantikmuSegeraTiba mumpung ada promo GrabJian!💨\n', 89, '2024-05-24 10:23:20', 0.000085331, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3374955580647832339', 7, 1, 1580),
