(5181, '3364764697088536037', 'grabid', 14, 'https://www.instagram.com/p/C6yC6oqvK3l/', 'Kota Malang, rumah kedua bagi banyak mahasiswa, menjadi latar belakang #CeritaNico …\n\n...ketika ia berpetualang layaknya seorang pelajar.\n\nHidup di rantau sering menuntut mahasiswa beradaptasi dengan rutinitas baru. Masakan rumah tergantikan dengan kuliner lokal, dan rute pergi ke kampus pun penuh hal baru yang bisa dicoba.\n\nTeknologi tak hanya mempermudah kegiatan kuliah, namun juga dapat membawa kenyamanan yang dirindukan oleh mereka yang merantau jauh dari kampung halamannya. Berbagai rintangan keseharian dapat dihadapi dengan beberapa ketukan jari.\n\nGrab #Percaya bahwa kemudahan yang dihadirkan oleh teknologi bisa menyulut semangat baru bagi mahasiswa untuk terus berinovasi dan berkreasi.\n\n@nicholassaputra\n', 2290, '2024-05-10 08:54:51', 0.00209772, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3364764697088536037', 70, 1, 12911),
