(5194, '3353747014759061665', 'grabid', 14, 'https://www.instagram.com/p/C6K5yQZPZih/', 'Gimana gajian cuma lewat tanpa permisi, orang suka foya-foya. Biarin aja, ntar juga bingung pas di akhir bulan. WKOWKWKW\n\nMakanya jangan lupa berhemat, oke? Nah biar gajian kamu lebih awet lagi, jangan lupa subscribe GrabUnlimited yang bisa kasih kamu banyak diskonan. Dari diskon setiap order makanan di GrabFood, sampe diskon 15% buat kalian yang mau pergi-pergi naik GrabBike/GrabCar. Untung banget kan?\n\nEhh kok masih di sini aja? Buruan Subscribe GrabUnlimited yang hematnya gak santai sekarang juga!\n', 19385, '2024-04-25 04:05:07', 0.0173017, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3353747014759061665', 80, 1, 2230029),
