(5230, '3322532369976669442', 'grabid', 14, 'https://www.instagram.com/p/C4cAZZDMjUC/', 'Warung Sobat Hemat siap nge-boost serunya Ramadan kamu nih! 🌙🚀\nDatang ramein dan lakukan transaksi di #Aplikasih Grab untuk dapat takjil gratis plus semakin banyak transaksi, semakin besar kesempatan kamu buat dapetin THR s.d. 1jt! 🤑💰 \n\nJangan sampai kelewatan keseruannya yuk! Serbu Warung Sobat Hemat dari tanggal 13 - 17 Maret 2024 di lokasi-lokasi berikut:\nPasar Benhil, Masjid Istiqlal, Masjid Al-Azhar, & Ruko Grand Galaxy. Kami tunggu kedatanganmu yaa!💚\n', 290, '2024-03-13 02:25:45', 0.000280881, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3322532369976669442', 26, 0, NULL),
(5231, '3322037374500008002', 'grabid', 14, 'https://www.instagram.com/p/C4aP2QlpPBC/', '📣 Tonton sampai akhir video resepnya, ada kode voucher GrabMart diskon 50%!\n\nSahabatku Tercinta, yuk awali bulan puasa dengan yang segar dan manis ❤️\nIni dia resep minuman simple bersama Fanta, Es Fantasi (Fanta, Kolang kaling dan Selasih).\n\nCocok untuk berbuka, atau ide jualan sahabatku di seluruh Indonesia.\n\n#GrabMart #sejamsampai #Aplikasih\n', 15857, '2024-03-12 10:04:17', 0.0143027, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3322037374500008002', 234, 1, 898729),
(5232, '3321793345549579727', 'grabid', 14, 'https://www.instagram.com/p/C4ZYXK6vTXP/', 'Ay ya ya!\nEits, ada kabar gembira nih dari Nassar, bukan Nastar ya!\n\nBagimu Seller dari GrabExpress siap bantu seller se-Indonesia buat kirim-kirim jualan lebih cuan!\n\nPeNassaran? Bagimu Seller dari GrabExpress punya ongkir mulai dari Rp5rb, terus punya diskon ongkir unlimited dengan langganan Paket Ongkir Unlimited cuma Rp1rb, ada juga cashback gede sampai 1jt dengan join Klub Juragan GrabExpress!\n\nSelain itu, ada pelatihan buat seller biar jualannya makin cuan!\n\nGimana? Yuk semuanya! Kirim paket pake GrabExpress!\n\n#Nassar #KingNassar \n#NassarOppa #BagimuSeller\n', 10573, '2024-03-12 02:00:11', 0.00954018, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3321793345549579727', 160, 1, 702071),
(5233, '3321784542334622312', 'grabid', 14, 'https://www.instagram.com/p/C4ZWXESPRpo/', 'Bulan Ramadan yang ditunggu-tunggu akhirnya datang juga. Banyak banget berkah yang bisa kita dapetin di bulan ini. Makanya Grab hadir sebagai #Aplikasih untuk sesama buat bantuin kamu kasih ke orang-orang terkasih. \n\nKamu bisa dengan mudah kasih makanan ke tetangga, kasih belanjaan untuk sahur, kasih untuk silaturahmi rame-rame, sampai kasih bingkisan juga bisa! Pahalanya dapet, promonya juga dapet dong pastinya! 💚\n', 11540, '2024-03-12 01:41:04', 0.0103464, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3321784542334622312', 100, 1, 1643478);
