(5234, '3319680909824635519', 'grabid', 14, 'https://www.instagram.com/p/C4R4DL1vjJ_/', 'Mbak @najwashihab bilang, “Investasi pada diri sendiri itu harus diupayakan, dengan usaha keras secara konsisten, dan butuh pengorbanan, sehingga sekecil apa pun pencapaiannya harus dirayakan”. \n\nDalam bincang-bincang memperingati Hari Perempuan Internasional bersama ratusan karyawan Grab Indonesia dan OVO, mbak @neneng.goenadi (Country Managing Director, Grab Indonesia) juga menyampaikan, “Bangun lebih pagi buat olahraga itu effort banget, tapi saya melakukan itu sebagai investasi buat diri sendiri, supaya badan tetap bugar dan kerja jadi lebih fokus”. \n\nKamu sudah melakukan investasi apa nih untuk diri sendiri? Yuk, kita mulai dari hal sederhana. \n\nTerima kasih mbak @najwashihab telah berbagi cerita dan mengingatkan teman-teman sesama perempuan Indonesia akan pentingnya berinvestasi pada diri sendiri untuk kemajuan bersama. \n\nSelamat Hari Perempuan Internasional!\n\n#PercayaPerempuan\n', 792, '2024-03-09 04:00:24', 0.000719091, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319680909824635519', 17, 0, NULL),
(5235, '3319632773047562664', 'grabid', 14, 'https://www.instagram.com/p/C4RtGs-PrGo/', 'Dengan Sobat Hemat, ada yang bisa dibantu? 😊\n\nOh, mau order ini itu tapi tetep murah? Yaudah kak, coba simak dulu videonya sampai akhir, udah di spill cara HEMAT versi mimin Grab, kalo versi kamu gimana? 👀\n', 9110, '2024-03-09 02:25:58', 0.008118, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319632773047562664', 23, 1, 570914),
(5236, '3319140656558768048', 'grabid', 14, 'https://www.instagram.com/p/C4P9Ndxvf-w/', 'Orange Chicken Fanta🍗🍊🥤\n— bikin ayam pake soda?!\n\nGak berasa ya ternyata sebentar lagi udah Ramadhan lagi..🥹 Kali ini, aku mau share salah satu resep favoritku yang tentunya super simple dan enak :) Semua bahan-bahanya belanja di GrabMart, aplikasih untuk sigap belanjakan Ramadhan💚 Ada diskon s.d. 15% + 50rb lho, dan tentunya sejam sampai tanpa perlu antri antri~\n\nBahan-bahan: 1 buah dada ayam (potong-potong), garam dan lada secukupnya, ½ sdt bawang putih bubuk, ½ sdt paprika bubuk, 100ml fanta orange, 100gr sdm tepung terigu, minyak untuk menggoreng\nSaus: 2 sdm madu, 2 sdm air lemon, 1 sdt kecap manis\n\nCara membuat:\n- Marinasi ayam dengan garam, lada, bawang putih bubuk, paprika bubuk, dan Fanta orange!\n- Baluri ayam dengan tepung, kemudian goreng sampai matang kecoklatan.\n- Campurkan semua bahan saus dan tuang ke ayam, aduk rata dan siap untuk disajikan dengan nasi hangat ~\n\n#orangechicken #takeawayfood #chickenrecipe #friedchicken #ramadhan #asmr #asmrfood #foodporn #viralrecipes #foodstagram #foodblogger #instafood #aesthetic #homecooking #homecook #homecooked #cookingvideo #homecookingvideo #foodaesthetic #cookingathome #onthetable #recipe #easyrecipes #easyrecipe #easyrecipesathome #resepsimple\n', 497, '2024-03-08 10:08:25', 0.00044621, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319140656558768048', 5, 1, 4057),
(5237, '3319029184264618798', 'grabid', 14, 'https://www.instagram.com/p/C4Pj3VHP0Mu/', 'Lomba apa yang nggak bikin rugi? Berlomba-lomba dalam kebaikan dan berbagi bareng GrabMart Kilat, #apliKASIH untuk sigap belanjakan kebutuhan Ramadan kamu. Nah, GrabMart Kilat udah duluan kasih kamu diskon sampai Rp50rb, 30 menit sampai, dan masih banyak lagi diskon spesial Ramadan yang udah nungguin kamu. Nggak perlu lagi khawatir yaa, karena kebaikan bisa dimulai dari nyebarin diskonan!\n', 899, '2024-03-08 06:25:32', 0.000807089, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3319029184264618798', 9, 0, NULL),
(5239, '3317791543166533562', 'grabid', 14, 'https://www.instagram.com/p/C4LKdSBPH-6/', 'Halooo, mau kasih tau aja nih… Selama bulan Ramadan ini, Grab ganti jaket dulu, dari aplikasi jadi\n.\n.\n.\nAPLIKASIH\n\nSemua ini bisa terwujud karena banyak partner yang rela bekerja sama dengan Grab demi memberikan banyaaaaaaaak promo dan layanan.\n\nSupaya apaa? Supaya kamu bisa lebih sering kasih-kasih selama bulan Ramadan ini. Jadi tenang aja, selalu ada yang bisa kamu kasih-kasih.\n\nNaah, untuk kamu para pengasih, sekarang jangan ragu buat kasih-kasih, karena Grab sudah lulus jadi APLIKASIH UNTUK SESAMA.\n', 1481, '2024-03-06 13:29:10', 0.00141952, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3317791543166533562', 116, 1, 17539),
(5240, '3317790999182148094', 'grabid', 14, 'https://www.instagram.com/p/C4LKVXZPYH-/', 'Bulan ramadan punya banyak cerita kasih yang hadir tidak terduga, lihat aja foto ini bawa senyum di wajah dan hangat di hati, kalau kamu harus cerita momen kasih yang paling kamu inget saat Ramadan ada apa aja? \nShare di kolom komentar yuk\n\n#Aplikasih\n', 694, '2024-03-06 13:25:29', 0.000652426, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3317790999182148094', 40, 0, NULL),
(5242, '3313440089283672584', 'grabid', 14, 'https://www.instagram.com/p/C37tDSySroI/', '#NgeRestoSeenaknya bisa langsung dapet diskon di tempat? GrabFoodies WAJIB tau ini!\n\nSekarang ada fitur Dine-in Discount di Dine-in Deals #GrabFood, bisa langsung dapet diskon s.d. 25%, lhoo 😱\n\nNggak perlu ribet-ribet, tinggal masukin total jajanan kamu, promo otomatis ter-apply dan kamu bisa langsung bayar ke kasir 🤑\n\nEasy peasy lemon squeezy, dan pastinya makin hemat! Langsung aja ajak teman, pacar, keluarga kamu #NgeRestoSeenaknya di Dine-in Deals #GrabFood sekarang! 🥰🫰🏻\n', 525, '2024-02-29 13:22:07', 0.000489764, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3313440089283672584', 26, 1, 4466),
(5243, '3309628395900249238', 'grabid', 14, 'https://www.instagram.com/p/C3uKX2sLiSW/', 'Sekarang udah tau kan produk yang pas buat kamu beli abis gajian?\n\nKalo udah mau abis, langsung restock. Kalo mau coba produk lain cek aja di GrabMart mumpung ada promo GrabJian GrabMart yang ngasih kamu diskon sampe Rp50rb dijamin fresh dan masih frozen terus cuma sejam sampai. Bisa belanja bulanan sambil lanjut rebahan deh! 💨\n\nKalo diskonnya segede ini, kamu mau beli apa? Tulis di kolom komentar yaa ☝🏻\n', 1701, '2024-02-24 07:07:51', 0.00156173, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3309628395900249238', 56, 0, NULL),
(5244, '3309496392369918892', 'grabid', 14, 'https://www.instagram.com/p/C3tsW80pVOs/', 'Harus belanja bulanan tapi lagi di tengah-tengah kesibukan? GrabMart Kilat jadi solusi buat kamu yang nggak suka antrian, bingung cari parkiran, atau macet-macetan di jalan. \n\nNggak perlu khawatir! Belanja hemat pas gajian akhir bulan di GrabJian GrabMart Kilat bisa dapet diskon s.d Rp50rb pake kode voucher: KILAT50 dan dijamin 30 menit sampai. \nBuruan promonya cuma sampai 29 Feb 2024! Checkout sekarang!\n', 465, '2024-02-24 02:46:47', 0.000439988, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3309496392369918892', 30, 1, 5097),
(5245, '3309008384831207794', 'grabid', 14, 'https://www.instagram.com/p/C3r9ZgYpzly/', 'Apakah ibu-ibu emang suka update status gitu ya? 🤷🏻‍♀️ Daripada bengang bengong, mending ikutan GIVEAWAY GrabUnlimited Kaget Award yang berhadiah Nintendo Switch dan OVO Cash 300 ribu!\n\nCaranya gampang banget, kalian tinggal screenshot total saving GrabUnlimited di aplikasi Grab terus post di Instagram Story, masukkan ke highlight, lalu komen di sini kalo udah ikutan.\n\nLengkapnya, tonton sampai habis status mamakku ini!\n', 9446, '2024-02-23 10:36:56', 0.00849399, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3309008384831207794', 110, 1, 996309),
(5246, '3308953914831554240', 'grabid', 14, 'https://www.instagram.com/p/C3rxA3PrEbA/', 'Puncak Diskon Kilat GrabJian Sudah Kelihatan! 👀\n\nNikmatin promonya di 24-25 Februari 2024 di jam tertentu bakal ada diskon s.d. 90%! Ada juga diskon 50% + gratis ongkir kalau kamu langganan GrabUnlimited.\n\nFollow dan pantau terus #GrabFoodID biar gak ketinggalan #DiskonKilatGrabFood dan promo lainnya!⚡\n', 7010, '2024-02-23 08:49:08', 0.00630916, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3308953914831554240', 88, 1, 598910),
(5247, '3308091141852632471', 'grabid', 14, 'https://www.instagram.com/p/C3os13SvhWX/', 'Panggil apa aja boleh deh tapiiii…. Kalo mau yang paling hemat, mending kamu panggil GrabBike Hemat atau GrabCar Hemat deh, dapetin hematnya anter kamu ke mana aja, ngeeeng💨\n', 7911, '2024-02-22 04:14:32', 0.00727358, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3308091141852632471', 272, 1, 1657759),
(5248, '3307575403203083314', 'grabid', 14, 'https://www.instagram.com/p/C3m3k4PvTwy/', 'Kalo sayang, pasti ada usahanya. 🤭\nKalo repot atau mager, tapi ada yang mau dibeli, pasti ada solusinya.\nGak akan ada lagi ceritanya dibilang gak effort! Apalagi, sekarang ada GrabJastip yang bisa bantuin kamu beliin apa yang kamu butuhin plus dapet diskon s.d. 30rb dengan kode promo JASTIP.\n#AndalanJastipin\n', 5974, '2024-02-21 11:09:36', 0.00532341, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3307575403203083314', 15, 1, 1106064),
(5249, '3305199804706914797', 'grabid', 14, 'https://www.instagram.com/p/C3ebbXvPwHt/', 'Nge-Grab sambil kuliah? Bisalahhh…🛵🎓\n\nTau kan mas Baskoro yang kemarin viral? Nah, kali ini beliau mau berbagi cerita nih di #CeritaDibalikKemudi tentang motivasi dalam menjalani hidup, dan bagi waktu buat kuliah sambil nge-Grab. Kuliahnya selesai sampai wisuda, rezekinya tetap lancar jaya. Semoga bisa jadi inspirasi buat temen-temen yang lain juga ya!💚\n', 33473, '2024-02-18 04:30:07', 0.0299556, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3305199804706914797', 228, 1, 663118),
(5250, '3302251383595346755', 'grabid', 14, 'https://www.instagram.com/p/C3T9CMmPitD/', 'Kalo ga lihat isi pikiran istri bisa lupa nih mau ngasih kado valentine, untung ada GrabMart si penyelamat buat cari kado dadakan. Udah gitu, dapet diskon s.d 30rb + Diskon Ongkir, Sejam Sampai! Ga perlu ribet dan dijamin istri ga bakal ngambek 😆 Beli keperluan valentinemu di GrabMart!\n', 10962, '2024-02-14 02:52:53', 0.00976951, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3302251383595346755', 29, 1, 1712407),
(5252, '3300339966776497574', 'grabid', 14, 'https://www.instagram.com/p/C3NKba9vNWm/', 'Oh jadi ini yang menyebabkan semua orang kaget sampe pingsan! 😱 Langganan GrabUnlimited bisa dapet gratis ongkir tiap jajan GrabFood & diskon 15% tiap naik GrabCar dan GrabBike. *S&K berlaku.\n\nCoba deh guys cek juga berapa total saving kalian dan ikutan GrabUnlimited Kaget Award caranya:\n1.  Follow Instagram, Twitter atau Tiktok @grabid\n2. Screenshoot “Total Saving” GrabUnlimited kamu di aplikasi Grab\n3. ⁠Posting di social media pribadi (pilih salah satu)\na) di Instagram Story: Posting di IGs pribadi dan tag @grabid, masukan screenshoot Instagram story ke highlight story dengan judul “GrabUnlimited” dan komen di postingan ini & ajak 3 temanmu buat ikutan\nb) di Twitter/Tiktok : posting di Twitter/ Tiktok tag @grabid dan gunakan hashtag #KagetnyaGrabUnlimited\n4. Akun media sosial tidak dikunci/private\n5. ⁠Periode challenge 11 februari - 9 maret 2024\n6. ⁠1 (satu) pemenang beruntung akan mendapatkan Nintendo Switch dan 20 (dua puluh) pemenang lainnya akan mendapatkan masing-masing Rp300rb OVO cash\n7. ⁠Pemenang akan diumumkan pada 15 Maret 2024\n8. ⁠Keputusan tim Grab bersifat mutlak dan tidak dapat diganggu gugat. Adanya penyalahgunaan informasi dalam partisipasi kompetisi bisa mengakibatkan diskualifikasi\n9. ⁠Semoga beruntung!\n', 54302, '2024-02-11 11:34:12', 0.0488964, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3300339966776497574', 708, 1, 2301056),
(5253, '3300099968726737197', 'grabid', 14, 'https://www.instagram.com/p/C3MT2_XPCEt/', 'Mau romantis jangan pusing, gak ngasih kado.. ayangmu langsung darting. Nih ada solusi sakicep tring biar ayang langsung salting. Beliin kado romantis di GrabMart, pesannya dari Hp pasti sejam sampe. Dijamin dia langsung gedebug lope. Dari bunga cantik, camilan lezat, sampe coklat yummy, semuanya ada di sini. Ada diskon s.d. Rp30rb juga lagi. Ikan hiu bisa melayang, kalau love you.. yuk belanja sekarang! 💕\n', 278, '2024-02-11 03:36:34', 0.00026577, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3300099968726737197', 21, 0, NULL),
(5254, '3297388148505311970', 'grabid', 14, 'https://www.instagram.com/p/C3CrQz-Pfri/', 'Sederhana tapi bikin si introvert happy. ⁣\nApa ya kira-kira? ⁣\nYa kirim hampers Imlek make #GrabExpress, ongkir mulai Rp 5rb.\n', 13940, '2024-02-07 09:49:19', 0.0124334, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3297388148505311970', 48, 1, 803559),
(5255, '3295934850891904308', 'grabid', 14, 'https://www.instagram.com/p/C29g0jGPfU0/', 'FOMO pasti negatif? Nggak selalu sih. \n\nFear of missing out atau disingkat FOMO, takut ketinggalan sesuatu yang lagi rame, sering diasosiasikan sebagai sifat Gen Z, dan konotasinya nggak positif 😐\n\nPadahal, ini bisa banget dimanfaatkan, lho. Penulis muda, Erisca Febriani yang tulisannya sudah banyak diangkat jadi film justru merasa FOMO bisa jadi komoditas. Hahh, kok bisa?\n\n@eriscafebriani bilang, dengan bikin kegiatan positif yang seru dan rame, orang-orang bisa jadi penasaran dan ingin nyoba. Contohnya, ketika baca buku dikemas dengan kegiatan-kegiatan komunitas yang fun, bisa menarik banyak peminat baru dari kalangan muda yang penasaran. \n\nMahasiswi tingkat akhir di @ipbofficial ini juga nggak setuju kalau Gen Z dicap kurang sat set. Lahir di dunia yang lebih terbuka, terhubung secara global dan menghadapi jauh lebih banyak pilihan dibanding angkatan pendahulu, jadi faktor yang dirasa Erisca bikin Gen Z terkesan ragu dalam melangkah. Namun dipastikan semua itu bukan jadi penghalang, sebaliknya, bikin terbukanya banyak kesempatan. Setuju banget! 😍\n\nSaat ini Erisca sedang menggarap beberapa proyek, di antaranya adalah lanjutan seri Dear Nathan yang akan digarap menjadi film, dan buku seru yang akan mengangkat segala sesuatu hal khas dari era 2000an awal.\n\nSukses terus ya, Erisca! 👏\n\n#Generasi #GenerasiPercaya\n', 693, '2024-02-05 09:42:55', 0.000667537, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3295934850891904308', 58, 1, 7152),
(5256, '3292367672471671000', 'grabid', 14, 'https://www.instagram.com/p/C2w1vRTp1DY/', 'Kata siapa Gen Z cuma bisa boros?\n\n #GrabUnlimited\n', 6211, '2024-01-31 11:36:16', 0.00559985, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3292367672471671000', 89, 1, 82200),
