(5272, '3265292734159409862', 'grabid', 14, 'https://www.instagram.com/p/C1QpnEDPFLG/', 'Menyambut tahun baru jangan cuma temen aja yang banyak stoknya, stok tahun baruan juga mesti disiapin dari sekarang!\n\nNggak perlu repot-repot antri belanja karena di GrabMart Kilat dijamin 30 menit sampai dan ada extra diskon sampai 50ribu loh!\n\nLangsung stok sekarang juga dan bikin tahun baruan kalian lebih meriah dengan GrabMart Kilat #Megahedon!\n', 1283, '2023-12-25 03:00:48', 0.00123552, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3265292734159409862', 107, 0, NULL),
