(5276, '3263118248627310423', 'grabid', 14, 'https://www.instagram.com/p/C1I7MIlho9X/', '“Kasih Ibu kepada Beta, tak terhingga sepanjang masa…”\n\nSiapa yang auto-nyanyi juga?\nUdah bilang “Terima kasih, Ibu” & “Aku sayang sama Ibu” belum?\n\nDi hari yang spesial ini, yuk kasih ekstra perhatian kepada sosok yang menjadi ruang nyaman pertama, yang merayakan setiap pencapaian, dan menjadi pahlawan dalam kehidupan kita.\n\nTerima kasih kepada para Ibu hebat di manapun berada.\nSelamat Hari ibu 2023.\n', 1335, '2023-12-22 03:00:30', 0.00123374, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3263118248627310423', 53, 0, NULL),
