(5281, '3261017108098011664', 'grabid', 14, 'https://www.instagram.com/p/C1Bdcg-p1IQ/', '\"We need trust.”\n\nMusisi @JubileeMarisa, mahasiswi Universitas Brawijaya secara halus menepis pandangan generasi sebelumnya yang cenderung menggambarkan bahwa generasinya belum dewasa. Menurutnya, semua manusia, berproses, bertumbuh dan berkembang.\n\nJubi, panggilan Jubilee, sudah merilis 4 lagu di semua platform streaming musik. Dia adalah bagian dari generasi yang sejak lahir dekat dengan teknologi dan juga media sosial. Beda dengan generasi sebelumnya, akses untuk bermusik dan menerbitkan karya jauh lebih dimudahkan, tapi ini juga berarti kompetisi yang sangat besar karena semua akan berebut audiens. Menurut Jubi, di antara banyak syarat penting dalam berkarya adalah mengutamakan kejujuran dan ketulusan.\n\nLahir di keluarga musisi, tumbuh di rumah yang tidak pernah sepi dari musik, sahabat menyebut Jubi “lahir di atas gitar”. Walau demikian, bermusik adalah murni pilihan Jubi, bukan atas dorongan keluarga. Menurut Jubi, genre musiknya adalah “bedroom pop”. Sejak kecil, musik menjadi jendela juga jembatan, yang memungkinkannya berekspresi jujur tanpa pretensi, menembus ruang apapun yang menjadi pemisah.\n\nJubilee Marisa membuka episode perdana #Generasi, yang akan dihadirkan Grab setiap bulan untuk mengangkat bakat-bakat muda Indonesia, baik karya maupun opininya. \n\nSemua materi audio & visual pribadi digunakan dengan izin pemilik.\n\n#Percaya #GenerasiPercaya\n', 2120, '2023-12-19 05:27:04', 0.0019395, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3261017108098011664', 62, 1, 40914),
