(5289, '3258116732956752795', 'grabid', 14, 'https://www.instagram.com/p/C03J-gIpLub/', 'Emang bisa yaa dapet iPhone & emas 10 gram GRATIS cuma modal kirim-kirim paket? 😱\n\nTentu bisa dooong, kan ada Gifting Challenge spesial akhir tahun dari GrabExpress ~\n\nKalo mau tau caranya, langsung geser ke kiri aja yaa! Buruan ikutan, karena periodenya cuma sampe 31 Desember 2023 nih 😌\n', 1596, '2023-12-15 05:23:22', 0.00144352, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3258116732956752795', 28, 0, NULL),
(5290, '3257487266939203311', 'grabid', 14, 'https://www.instagram.com/p/C0062kORO7v/', 'Hayo tebak kira2 berapa total penghematan gue pesen GrabFood pake GrabUnlimited dalam sehari??\n\nBuat kalian yang bisa tebak, tulis jawabannya di kolom komentar ya pakai hashtag #GrabUnlimited!! \n\nNanti ada hadiah special dari gue, OVO cash senilai masing-masing Rp 100.000 untuk 3 pemenang!\n\nSemoga beruntung yaa!!\n\nGue tunggu sampe 17 Desember 2023~\n\nCongrats to winners:\n@fratamaa17\n@_abiarrasyid\n@aprllfina04_\n', 11154, '2023-12-14 08:33:24', 0.0101473, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3257487266939203311', 262, 1, 196775),
(5291, '3256746129687532268', 'grabid', 14, 'https://www.instagram.com/p/C0ySVmXp1Ls/', 'Jadi pesan terus nih gara-gara Grab Paling Hemat! Gampang banget buat kamu ke mana-mana. Yuk yang lain, cobain GrabBike Hemat & GrabCar Hemat deh. Dijamin ga bikin boros karena Grab, Sobat Hemat-mu. 🌟🛵🚗💨\n', 9503, '2023-12-13 08:00:00', 0.00852332, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3256746129687532268', 86, 1, 1017710),
(5292, '3256146129241210987', 'grabid', 14, 'https://www.instagram.com/p/C0wJ6caL4Br/', 'Terima kasih buat 16 sekolah yang udah mau dibikinin pensi gratis sama Grab dan Prambors! 💚💛\n\nMimin kasih liat dikit deh seberapa serunya sekolah-sekolah itu didatengin musisi-musisi yang super-duper gokill 🔥 Ada Isyana Sarasvati, GAC, Nadhif Basalamah, Jaz Hayat daaaan masih banyak lagi!\n\nKalo mau liat fullnya, langsung cus ke YouTube Prambors ajaa Kawula Muda okeeeh?! 😉\n\nTahun depan bikinin SMA-SMA pensi gratis lagi kali ya? GAK CUMA JABODETABEK seru siiih~ *colek  @grabid \n\n#SkulprizeXGrab\n#Skulprize2023\n', 381, '2023-12-12 12:11:40', 0.000356435, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3256146129241210987', 20, 1, 6406),
(5294, '3254492104719963443', 'grabid', 14, 'https://www.instagram.com/p/C0qR1OCJZUz/', 'Coba tunjuk tangan yang kemarin ikutan? ☝️\n\nRibuan Mitra Merchant dari 25 kota antusias kenalan satu sama lain, berbagi pengalaman dan belajar bareng seharian untuk memperkaya wawasan peluang bisnis 2024 bersama pembicara berpengalaman seperti @jordionsu @gufronsyarif @andrysusanto @charinaprinandita @tina_talisa @leonard_theosabrata @rengkuh.banyu @amichsan 🥰\n\nTerima kasih, Teman-teman Mitra Merchant. Sampai jumpa di kegiatan selanjutnya dan semoga kita bisa makin cuan cuan cuan! 💚\n\n#CuanBarengGrab\n', 277, '2023-12-10 05:24:04', 0.000274659, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3254492104719963443', 32, 1, 3274),
(5295, '3253920885421674059', 'grabid', 14, 'https://www.instagram.com/p/C0oP84myI5L/', 'emang di sini ada yang gasuka minum aer putih? 🥲\n\nbiar gak nyampah kirim daur ulang pake GrabExpress dengan kode: LANGKAHHIJAU40RB ya❗️\n\n#LangkahHijau #GrabForGood\n', 3058, '2023-12-09 10:44:56', 0.0027537, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3253920885421674059', 40, 1, 42211),
(5296, '3253726278656182182', 'grabid', 14, 'https://www.instagram.com/p/C0njs-7p8em/', 'Pasti panik & bete seharian nih kalo kejadian gini 😌 \n\nCiwi-ciwi, kalo lipstick kalian tiba-tiba abis, bedak pecah, mascara kering atau eyeshadow palette rusak, tarik nafas aja dulu.. semuanya bisa dititip beli pake GrabJastip kok! Ada diskon s.d 30ribu pake kode promo JASTIP 🫶🏻\n', 26872, '2023-12-09 04:00:00', 0.0240402, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3253726278656182182', 174, 1, 2962963),
(5297, '3253225377331811267', 'grabid', 14, 'https://www.instagram.com/p/C0lxz6OJhPD/', 'Bisa seHOROR itu!\n\nEh, dengerin cerita seru nih dari Ibu Hasanah, Mitra GrabBike yang super kece! Selain jadi ibu rumah tangga, beliau juga aktif sebagai ketua URC Jakarta Selatan loh. Di #CeritaDibalikKemudi kali ini, bu Hasanah bakal berbagi cerita menyeramkan saat bekerja membawa penumpang perempuan yang berakhir di luar dugaan. \n\nNah, penasaran kan? Jangan lupa tonton videonya sampai habis! 👻🛵\n', 17601, '2023-12-08 11:28:29', 0.0159551, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3253225377331811267', 349, 1, 1039866),
(5298, '3252533443674203215', 'grabid', 14, 'https://www.instagram.com/p/C0jUe8yR2RP/', 'Guysss, ada 50 diamond MLBB buat 3 pemenang nih.\n\nYang mau coba jawab pertanyaan berikut yaa:\n\nBerapa kali gue ngomong \"GrabUnlimited dapat diskon jalan & gratis ongkir tiap pemesanan\" di video ini?\n\nReply di kolom komen pakai #GrabUnlimited ya.\n\nGue tunggu sampe tanggal *10* Desember 2023. \nBuat yang belum subscribe, buruan deh subscribe GrabUnlimited biar bisa saving lebih banyak.\n\nCongrats to winners:\n@fernando_vickoo\n@denbagues00\n@syahrulmoe\n', 11461, '2023-12-07 12:30:46', 0.010405, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3252533443674203215', 245, 1, 145125),
(5299, '3252488341937413081', 'grabid', 14, 'https://www.instagram.com/p/C0jKOohR1vZ/', 'Kemarin gw lari di CFD bareng temen2,\neeh ada jam ngejar kita!\nMeskipun jadinya lari kejar-kejaran waktu alias mepet, gw dan man teman tetep hepi :)\n\nJadi kalo kalian mepet mau kirim kado / hampers,\npakai GrabExpress aja!\nPasti cepet dan beres.\nOngkirnya mulai dari Rp5rb! 😉\n', 542, '2023-12-07 11:00:46', 0.000514652, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3252488341937413081', 37, 0, NULL),
(5300, '3252420701267159806', 'grabid', 14, 'https://www.instagram.com/p/C0i62VPJ-r-/', 'Nggak usah panik kalo kepepet, kan ada GrabExpress!\n\nMau kirim hampers natal, kado hari ibu, atau paket apapun itu? Pake yang CEPET & BERES aja 😉\n\nOngkirnya mulai 5 ribu aja lhooo~\n', 194, '2023-12-07 08:46:42', 0.000185773, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3252420701267159806', 15, 1, 3190),
(5301, '3250766864560505645', 'grabid', 14, 'https://www.instagram.com/p/C0dCz1xvUMt/', 'Ada kabar seru untuk kita semua nih.\n\nTau Ndarboy Genk ngga? Itu lho, penyanyi Mendung Tanpo Udan yang viral dan dance nya sampai diikuti artis Kpop di TikTok?\n\n@ndarboy_genk hari ini merilis single “Modal Percoyo”, hasil kolaborasi bareng Grab dan OVO. \n\nAda cerita menarik  di balik lagu ini. Mas Daru (Vokalis Ndarboy Genk) ternyata dulunya pernah jadi mitra driver Grab. Ini baru ia ungkapkan waktu tampil di Hari Mitra Grab tahun lalu di Jogja. Nah, berangkat dari situ Ndarboy Genk terinspirasi untuk menciptakan lagu Modal Percoyo sebagai bentuk apresiasi kepada mitra driver Grab di seluruh Indonesia. Di lagu ini Mas Daru curhat tentang perjuangan dan kegigihan dirinya dan para driver ojol dalam menghadapi tantangan demi menghidupi keluarga. \n\nLagu “Modal Percoyo” sekarang sudah bisa dinikmati di Youtube Ndarboy Genk dan platform musik favorit kamu. Untuk lebih mudahnya bisa klik link di bio. Yuk kita dengerin. Dijogetin juga boleh!\n\n#ModalPercoyo #ModalPercaya #NdarboyGenk #Grab #OVO\n', 66016, '2023-12-05 02:00:00', 0.0590819, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3250766864560505645', 453, 1, 1403192),
(5302, '3250283804169122665', 'grabid', 14, 'https://www.instagram.com/p/C0bU-YutLNp/', 'Buat kamu si paling kantoran atau kamu si paling rumahan, karyawan, mahasiswa di seluruh Indonesia, ada yang seru nih!!! Lagi ada promo Grab Megahedon, megahnya diskon di GrabFood & GrabMart! Ada diskon Rp150.000 di GrabFood dan diskon Rp50.000 + ongkir hemat di GrabMart. \n\nYuk hedonin akhir tahunmu bareng mega diskon di Grab Megahedon!\n', 217, '2023-12-04 10:00:54', 0.000210661, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3250283804169122665', 20, 1, 4185),
(5303, '3250223446582117779', 'grabid', 14, 'https://www.instagram.com/p/C0bHQEWLEWT/', 'Apa-apa pesannya GrabBike Hemat & GrabCar Hemat, ke sana-sini, sini-situ pesan lagi. \n\nHeran, bisa segampang dan sesering itu karena Paling Hemat buat anterin ke mana aja. Ditambah ada Ekstra Cashback cuma dengan ikutan Sobat Hemat Challenge di Aplikasi Grab lho 🤩\n\nIni baru #SobatHemat, cobain deh~\n', 194, '2023-12-04 08:01:11', 0.000191995, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3250223446582117779', 22, 1, 3628),
(5304, '3249423283126697950', 'grabid', 14, 'https://www.instagram.com/p/C0YRUKDpn_e/', 'Satukan keberagaman, rayakan kekuatan dalam perbedaan. Bersama-sama kita bangun Indonesia yang inklusif dan #setara bagi semua. \n\nSelamat Hari Disabilitas Internasional 2023.\n\n#PercayaSETARA\n', 1014, '2023-12-03 05:31:02', 0.000955529, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3249423283126697950', 61, 0, NULL),
(5306, '3246684574866382671', 'grabid', 14, 'https://www.instagram.com/p/C0OimtOpp9P/', 'Ngubek sampe yang jauh-jauh, ujung-ujungnya milih yang itu-itu juga. Ngaku gais siapa yang selalu begini? 🥱\n', 213, '2023-11-29 10:50:03', 0.000232882, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3246684574866382671', 49, 1, 5500),
(5307, '3240170529822162113', 'grabid', 14, 'https://www.instagram.com/p/Cz3Ze4BvTzB/', 'Ada yang manis namun kali ini bukan senyummu, ini Oatside Choco Black Forest & Choco Marshmallow dari Kopi Kenangan!\n\nPerpaduan rasa manis dan kenyal dari Choco Marshmallow siap nemenin sore kamu hari ini. Eh, kalo mau yang polosan bisa cobain Oatside Choco Black Forest ya ges ya~\n', 346, '2023-11-20 11:07:28', 0.000455987, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3240170529822162113', 167, 0, NULL),
(5308, '3229097284414445280', 'grabid', 14, 'https://www.instagram.com/p/CzQDt8ms5bg/', 'Grab Indonesia & @ovo_id  umumkan donasi untuk Korban Konflik Gaza (Palestina), melalui @benihbaik.\n', 31403, '2023-11-05 04:26:54', 0.0397651, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3229097284414445280', 13334, 0, NULL),
(5309, '3226979555309079291', 'grabid', 14, 'https://www.instagram.com/p/CzIiM7rpUr7/', 'Kalo udah percaya sama sesuatu, semua pasti bisa ngejalaninnya seberat apapun beban yang lagi kita bawa. Kita semua bisa jadi orang tua, bisa jadi tulang punggung, bahkan kita #SemuaBisaJadiPahlawan versi kita sendiri buat diri sendiri dan keluarga. \n\nTerima kasih buat kamu yang udah pake jasa mereka, mulai dari GrabBike, GrabFood, sampe GrabMart dan MS GLOW juga. \n\nOiya, @msglowbeauty @mscosmeticofficial sudah tersedia di GrabMart, loh! Siap diantar, #SejamSampai!\n\nNah, menurut kamu, arti pahlawan versi kamu itu apa? Tulis di kolom komentar, ya!\n', 25266, '2023-11-02 06:22:14', 0.0265602, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3226979555309079291', 4615, 1, 725023),
(5310, '3226407718009172621', 'grabid', 14, 'https://www.instagram.com/p/CzGgLmsg_KN/', 'Apa yang lebih gede dari Megalodon🦈 hayo? Mega diskon di Grab Megahedon!\n\nNikmati parade diskon kolaborasi Grab dengan banyak brand tenar dan UMKM kesayangan. Di sini, kamu bisa jajan serta belanja sesukamu dan tetap hemat. Jajan semaunya di GrabFood? Ada diskon s.d. Rp150rb dan Pengantaran Hemat!\n\nBelanja sepuasnya di GrabMart? Tenang, ada promo s.d. Rp50rb dan ongkir hemat!\nMeriah, kan? Nikmati akhir tahun dengan promo dan diskon di Grab Megahedon! 🎉🥳\n', 1548, '2023-11-01 11:23:31', 0.00182573, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3226407718009172621', 506, 1, 49073),
(5311, '3225655134959479606', 'grabid', 14, 'https://www.instagram.com/p/CzD1EFHLKs2/', 'Niatnya sih ngeprank Halloween, eh malah diprank balik 👻\n\nYang jelas nggak ngeprank mah cuma Langganan Ongkir Unlimited-nya GrabExpress! Ada diskon ongkir sampe 50% lagi tiap kirim paket 📦\n\nCus langganan biar gak dikejar hantu aslinya..... 🧟‍♀️\n', 1271, '2023-10-31 10:29:47', 0.00134574, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3225655134959479606', 243, 1, 29756),
(5312, '3225535834835247896', 'grabid', 14, 'https://www.instagram.com/p/CzDZ8CNpeMY/', 'Temen kamu bisa ngonser dan self reward terus?? Kok bisa ya?\n\nEits, jangan berprasangka buruk dulu dong. Siapa tau mereka bisa saving gara-gara langganan #GrabUnlimited jadi bisa dapet diskon jalan dan gratis ongkir berkali-kali.\n\nBuruan langganan biar bisa ikutan saving juga, Gratis untuk 8 minggu pertama~\n', 211, '2023-10-31 06:34:02', 0.000241771, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3225535834835247896', 61, 1, 8817),
(5313, '3224914180312623598', 'grabid', 14, 'https://www.instagram.com/p/CzBMlxUp2nu/', 'Ketinggalan barang kamu di GrabCar? \nTenang, enggak  perlu panik.\nAda “Pusat Bantuan”, Bisa DM Mimin juga di sini, atau bisa hubungi Mitra Pengemudi setelah perjalanan berakhir. \nSelalu cek lagi barang bawaan kamu ya 🥰\n', 25705, '2023-10-30 09:59:29', 0.0229976, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3224914180312623598', 168, 1, 1071130),
(5314, '3224797540805557441', 'grabid', 14, 'https://www.instagram.com/p/CzAyEcURLzB/', 'Guys, Bram berhasil saving dan dapet tumbler hits gara-gara udah subscribe #GrabUnlimited 2 bulan.\nBuat kalian yang kemana-mana atau beli apapun make Grab, kata gue sih langganan sekarang, siapa tau dari hasil saving itu bisa buat beli barang inceran kalian~\n', 30798, '2023-10-30 06:04:51', 0.027673, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3224797540805557441', 335, 1, 354663),
(5315, '3224005623133671366', 'grabid', 14, 'https://www.instagram.com/p/Cy9-Ahgvo_G/', 'Pesta Warga hari pertama seru bat, pak. Rumah Seram rame bener tadi, kayaknya emang lebih serem daripada rumah2 hantu biasanya. Bisa sampe asam lambung!!! Mangkanya jangan lupa makan yah nanti. Di sini banyak booth makanan enak2, pesen pake GrabFood atau pake OVO biar dapet diskon dan dapet kesempatan menang Raffle PS5 dan emas batangan!!!\n', 853, '2023-10-29 03:55:27', 0.0007902, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3224005623133671366', 36, 1, 26657);
INSERT INTO `posts` (`id`, `post_id`, `username`, `profile_id`, `post_url`, `caption`, `likes`, `date_posted`, `engagement`, `local_download_directory`, `comments`, `is_video`, `video_views`) VALUES
(5316, '3223255772670224940', 'grabid', 14, 'https://www.instagram.com/p/Cy7Tgw2PGos/', 'Setuju nggak sih, generasi muda memiliki tantangan sendiri? Dan berkarya serta seni jadi salah satu nilai tambah untuk aktualisasi diri di era digitalisasi dan ketatnya persaingan. \n\nMimin yakin ada banyak anak muda berbakat di sini yang jago nyanyi, acting, atau punya opini dan meminati jurnalistik, tapi merasa insecure karena kompetisi yang berat, jadi butuh dukungan dan dorongan untuk mewujudkan potensi.\n\nBertepatan dengan Hari Sumpah Pemuda, Grab Indonesia dan OVO memperkenalkan \"Generasi\", sebuah inisiatif yang berupaya membantu membuka panggung yang lebih luas bagi anak muda berbakat di bidang seni, kreasi, dan jurnalistik yang belum terlihat karena ramainya persaingan. \n\nDengan memanfaatkan ekosistem Grab dan OVO, lewat \"Generasi\", para generasi muda ini tak hanya mendapatkan sorotan yang seharusnya, namun juga berkesempatan untuk makin berdaya, mendorong potensi diri dengan ragam edukasi hingga workshop untuk bertukar pikiran dengan sosok-sosok terbaik Indonesia.\n\nNantikan segera di @grabid dan @ovo_id!\n', 226, '2023-10-28 03:00:00', 0.000224883, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3223255772670224940', 27, 1, 3485),
(5317, '3222839271872688218', 'grabid', 14, 'https://www.instagram.com/p/Cy50z4QJnBa/', 'Kalian masih antri lama di supermarket? Mending belanja bulanan #CariPakaiGrabMart Kilat!\n\nMurah banget ada diskon s/d 50rb, plus 30 menit sampai 😉 Yuk belanja sekarang!\n', 5740, '2023-10-27 13:14:23', 0.00523097, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3222839271872688218', 145, 1, 726400),
(5318, '3222638481100754229', 'grabid', 14, 'https://www.instagram.com/p/Cy5HJ_Rg801/', 'DISKONNYA WADIDAW HEMATNYA WOW🥳\n\nUdah ikutan makan gratis #WajibKepoin ? Nah, besok waktunya kita rayakan dengan jajan di Diskon Kilat GrabJian #GrabFoodID !\n\nPuas jajan semua menu kesukaanmu dengan diskon s.d 90% dari jam 2 - 4 sore dan diskon s.d 40% atau 50% + gratis ongkir GrabUnlimited di jam tertentu.\n\nBuruan serbu #DiskonKilatGrabFood cuma 1 hari aja di tanggal 28 Oktober. Pastiin kebagian, cus jajan!\n', 16168, '2023-10-27 06:48:00', 0.0146965, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3222638481100754229', 366, 1, 714261),
