(5322, '3220610370744102942', 'grabid', 14, 'https://www.instagram.com/p/Cyx6BGUJDAe/', 'Mau nongkrong tipis-tipis, tapi kantong udah tiris?! 😱\n\nGak perlu meringis kawan~ kamu tetep bisa pergi ke hidden gem sana-sini pakai GrabCar Hemat!\n\nHemat tarifnya, satset dijemputnya!\nHidden gem hunter, tempat mana lagi nih yang mau dicoba? 😍\n', 10845, '2023-10-24 11:25:46', 0.00966907, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3220610370744102942', 33, 1, 574068),
