(5330, '3213966195151987819', 'grabid', 14, 'https://www.instagram.com/p/CyaTTnmJeRr/', 'Gasss poll dan kejar terus rejekinya!\n\nSeperti #CeritaDibalikKemudi kali ini dari Liem Anita & Muhammad Ilham Muhlis yang gak menyangka bisa menjadi salah satu pemenang hadiah Mobil & Motor dari program KEJAR REJEKI Hari Mitra Grab & OVO 2023, yang selalu konsisten semangat kejar rejeki on bid setiap hari.\n\nTonton video lengkapnya yuk ~\n', 3144, '2023-10-15 07:25:16', 0.0028337, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3213966195151987819', 44, 1, 149933),
(5331, '3212638310245903955', 'grabid', 14, 'https://www.instagram.com/p/CyVlYWaBK5T/', 'NgeGrabFood jauh dekat, ongkirnya dijamin hemat 👍\n\nGak perlu worry mikirin ongkir saat pesan makan dari jarak jauh atau dekat. Pakai rumus #HematematikaGrabFood, ongkirnya paling hemat mulai 3ribuan. Pas di kantong, gak bikin dompet bolong🤭.\n\nYuk, buktikan rumus hemat #ngeGrabFood sekarang!\n', 5476, '2023-10-13 11:26:34', 0.00492609, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3212638310245903955', 66, 1, 651529),
(5332, '3212439764622201474', 'grabid', 14, 'https://www.instagram.com/p/CyU4PIYpVKC/', 'Buat kamu yg masih sekolah atau kuliah, pernah gak sih ngerasa gak pede sama bakat sendiri? Atau khawatir passion kamu sekarang gak bisa jadi karir di masa depan? Hmmm 🤔🤔🤔\n\nJadi, beberapa waktu lalu, Grab Indonesia memfasilitasi talkshow bertema “Mendobrak Stigma: Seni dan Peluang Kerja” bersama teman-teman mahasiswa Universitas Brawijaya, Malang. Acaranya seru banget gaes! ✨\n\nAda @theodrematthew dan @jubileemarisa sebagai perwakilan dari mahasiswa dan penggiat seni. Ada @nicholassaputra juga yang spesial hadir membawa sudut pandang pekerja seni senior. Pastinya auto heboh yaa kedatangan Nicsap! 🤩 \n\nTeman-teman di sana juga antusias banget pas sesi interaktif dengan para narasumber. Pertanyaan yang diajukan teman-teman cukup kritis dan relevan. Salah satunya soal gimana caranya mengatasi insecurity atas karya sendiri, di mana Nico menekankan pentingnya berada dalam komunitas yang supportive juga konstruktif.\n\nSemoga sesi ini bisa menginspirasi anak-anak muda lain untuk terus semangat menggali passion dan berkarya yaa! 🥰\n', 579, '2023-10-13 04:52:50', 0.000550207, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3212439764622201474', 40, 1, 11270),
(5333, '3211029886158748155', 'grabid', 14, 'https://www.instagram.com/p/CyP3qsvp7n7/', 'Pengalaman yang gak akan terlupakan buat aku bisa dinner bareng sama para pemenang challenge #KejarRefal dan juga nyetirin mereka jalan-jalan. \n\nThank you Grab udah mewujudkan mimpiku buat bisa sedeket ini sama mereka. Pake terus GrabCar dan GrabBike, siapa tau bisa aku setirin dan dinner bareng juga 😎\n', 11287, '2023-10-11 06:10:43', 0.0101615, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3211029886158748155', 145, 1, 399140),
(5334, '3208860790646846049', 'grabid', 14, 'https://www.instagram.com/p/CyIKeNILzJh/', 'PUH SEPUH, AJARIN DONG BIAR JAJAN BANYAK TETAP HEMAT\n\nGampang! Tanggal 10 Oktober, serbu puncak Diskon Kilat 10.10 #GrabFoodID dengan diskon s.d 90% di jam 2 - 4 sore dan diskon s.d 50% plus GRATIS ONGKIR s.d Rp600rb buat yang langganan GrabUnlimited. \n\nRibuan resto hits GrabFood, banting harga, biar kamu bisa jajan hemat sepuasnya! Inget ya, cuma sehari aja dan terbatas di tiap jamnya. \n\nYuk serbu #DiskonKilatGrabFood!\n', 437, '2023-10-08 06:21:53', 0.00043821, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3208860790646846049', 56, 1, 8703),
(5335, '3208854094137822682', 'grabid', 14, 'https://www.instagram.com/p/CyII8whJI3a/', 'Selalu takjub sama energi para Mitra Grab & OVO kalau lagi kumpul begini 😍\n\nPerayaan tahunan ini dihadiri lebih dari 1.000 Mitra yang datang dari Aceh hingga Papua. Di Hari Mitra Grab & OVO 2023 yang diselenggarakan di Surabaya ini para Mitra menikmati hari dengan sajian kuliner, permainan berhadiah dan berbagai hiburan. \n\nBukan hanya jadi ajang untuk bisa berdendang dan berjoget bareng @ndarboy_genk dan @wikasalim, #HariMitraGrab juga jadi puncak perayaan Apresiasi Dana Abadi yang secara total menyalurkan Rp16,2 Miliar pada lebih dari 46.000 pejuang Transportasi dan pelaku UMKM, termasuk para Mitra Grab & OVO 🤩\n\nKira-kira, tahun depan HMG mau diadain di kota mana ya? 🤔\n', 428, '2023-10-08 06:08:32', 0.000406211, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3208854094137822682', 29, 1, 5016),
(5336, '3207546733506872159', 'grabid', 14, 'https://www.instagram.com/p/CyDfsKDJENf/', 'Rame amat nih kaya di pasar aja...\n\nTeh Rina Nose mah emang gitu, suka lupa kalo aslinya satu orang. Tapi, kalo urusan kirim-kirim paket mah nggak pernah lupa!\n\nCuman dengan kirim minimal 10 paket selama 3 bulan, udah bisa join Klub Juragan GrabExpress biar dapet bonus OVO poin banyak kayak yang lainnya tuh 😉\n\nGimana? Jadi pengen langganan GrabExpress juga kan?\n', 44534, '2023-10-06 10:59:05', 0.039974, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3207546733506872159', 438, 1, 2243194),
(5337, '3207484158668947020', 'grabid', 14, 'https://www.instagram.com/p/CyDRdksJ75M/', 'Selamat kepada 1.158 pelajar penerima beasiswa GrabScholar mulai dari jenjang SD, SMP, SMA/K, hingga Universitas. \n\nSetelah melalui seleksi ketat, para pelajar dari 138 kota/kabupated di Indonesia tersebut berhak atas bantuan dana pendidikan dari Grab dan OVO.\n\nMelalui pendidikan, mimpi dan harapan bisa diwujudkan. \n\nGrabScholar merupakan salah satu dari komitmen berkelanjutan Grab Indonesia dan OVO yang merupakan bagian dari program Apresiasi Dana Abadi, di mana pengumumannya dilakukan kemarin di Hari Mitra Grab & OVO 2023 yang dilaksanakan di Surabaya. \n\nNantikan informasi selanjutnya mengenai pendaftaran seleksi beasiswa GrabScholar di periode mendatang ya!\n', 390, '2023-10-06 08:47:31', 0.00036799, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3207484158668947020', 24, 1, 5454),
(5338, '3204681270762509882', 'grabid', 14, 'https://www.instagram.com/p/Cx5UKL6JZY6/', 'Menutup bulan September dengan kegiatan yang penuh haru, canda tawa serta kebersamaan untuk Mitra Grab.\n\nMelalui acara #HajatanMitraGrabOVO2023 yang diadakan di 5 kota (Bali, Bandung, Jakarta, Yogyakarta, dan Samarinda), lebih dari 5.000 Mitra Grab dan Keluarga berkumpul untuk menjalin silaturahmi dan bersenang-senang bersama.\n\nBanyak keseruan yang telah diikuti, mulai dari Apresiasi Mitra dan pembagian Doorprize, Festival Kuliner, _Games _hingga Hiburan Ekslusif dari bintang tamu seperti:\n@jegegbulan_ & @joniagung_doublet_band di Bali\n@thechangcuters & @adeastrid_91 di Bandung\n@gigibandofficial & @restyananta_ di Jakarta\n@hasoe.angel & @omwawes di Yogyakarta\n@jonojoni.official di Samarinda\n\nKami #Percaya setiap momen kebersamaan yang diukir oleh Mitra Grab akan memperkuat kebersamaan dan solidaritas. \n\n#SolidaritasSelamanya\n', 526, '2023-10-02 11:57:45', 0.000541318, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3204681270762509882', 83, 1, 6056),
(5339, '3204416966310193319', 'grabid', 14, 'https://www.instagram.com/p/Cx4YEDNJ2in/', 'Selamat Hari Batik Nasional!\n\nTahu nggak, kalau 2 Oktober diperingati sebagai Hari Batik Nasional oleh UNICEF, lho!\n\nLebih dari tekstil tradisional, batik merupakan warisan budaya Indonesia yang sudah mendunia. Corak ragam batik pun mengandung makna dan filosofi berbeda dari tiap ragam dan asal daerah. ✨\n\nOh iya, baju batik kontemporer yang dikenakan perwakilan Grab di foto ini merupakan baju rancangan dari @didietmaulana dengan label @sarupa_byikatindonesia! Bagus ygy? 😍\n\nKamu pakai batik apa hari ini? Pap di stories dong, mention @grabid, ya. Nanti mimin kirimin OVO cash buat dua orang! Yukk. 🤩\n\n#HariBatikNasional\n#BatikIndonesia\n#WarisanBudaya\n#Indonesia\n', 473, '2023-10-02 03:11:31', 0.000437321, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3204416966310193319', 19, 0, NULL),
