(5376, '3178439863085533134', 'grabid', 14, 'https://www.instagram.com/p/CwcFjcjJ4fO/', 'GRABMART LAGI BANYAK BUNDLING!!!\n\nDear, Moms! Buruan langsung aja serbu, mumpung lagi ada diskon GrabJian seru dari GrabMart Kilat, cuma di tanggal 25 - 31 Agustus 2023. Cari-cari stock bulanan yang lagi diskon sampe 50rb, gratis ongkir, dan dijamin 30 menit sampai.\n\nCarinya di mana? Cari jangan pakai mulut, #CariPakaiGrabMartKilat aja, mulai dari bahan-bahan dapur sampe popok semuanya ada. Cari bundling biar lebih murah.\nApalagi yang Moms tunggu? Buruan cek aplikasi Grab kamu!\n', 323, '2023-08-27 06:59:39', 0.000287103, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3178439863085533134', 0, 0, NULL),
