(5378, '3177127226420595153', 'grabid', 14, 'https://www.instagram.com/p/CwXbGEZBYnR/', 'Paling bener kalo orang tua sama mertua lagi bareng itu diajak jalan biar semakin akrab. Jalanya sambil Kejar Promo Gajian dan pilih yang pasti hemat naik GrabCar biar dapet diskon s.d 50% pake kode promo GRABJIAN 👌\n', 6546, '2023-08-25 11:34:03', 0.00593495, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3177127226420595153', 131, 1, 200159),
(5379, '3176879932456752121', 'grabid', 14, 'https://www.instagram.com/p/CwWi3d8JtP5/', 'Emang mamak-mamak +62 itu luar biasa dan serba bisa.\n\nBisa masak, bisa nemuin barang yang nggak keliatan,sampe bisa paling semangat kalo ada diskon dan promo.\n\nBuruan bilang ke mama, ibu, bunda, emak kalian, kalo mau dapet diskon di Grab yang nggak kenal waktu, langganan GrabUnlimited aja. Bisa dapet gratis ongkir Rp10rb tiap jajan dan diskon 15% setiap jalan kapan pun ga perlu nunggu hari tertentu. mantep kan. Modal gratis* eh untungnya berkali-kali. Siapa tau abis dapet promo, bisa sekalian minta jajanin~ hehehe\n', 250, '2023-08-25 03:26:06', 0.000230216, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3176879932456752121', 9, 1, 4664),
(5381, '3176261970439862859', 'grabid', 14, 'https://www.instagram.com/p/CwUWW79pnpL/', 'Bikin momen guyub bareng tetangga makin asyiek dengan menu #PercayaProjex TUKU.\n\nDengan memesan kopi TUKU #PercayaProjex di GrabFood, kamu ikut berkontribusi memberikan donasi hingga Rp5rb/produk untuk lanjutin aksi sosial yang diinisiasi oleh komunitas sosial dari seluruh Indonesia.\n\nIni dia menu-menu spesial khusus buat kamu👇\n\n✅#TukuSeruDiRumah + Kantong Krimer Sedang\n✅#TukuSeruDiRumah\n✅Kopi Hitam Tetangga (Panas)\n✅Kopi Susu Tetangga (Panas)\n✅Cappuccino (Panas)\n✅Tetangga Blend \n✅Cipete Blend\n\nCuss, ngopi buat lanjutin aksi!\n#DalamGuyubKitaPercaya\n', 136159, '2023-08-24 06:52:34', 0.121233, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3176261970439862859', 232, 0, NULL),
(5382, '3175624566207021403', 'grabid', 14, 'https://www.instagram.com/p/CwSFbfAxgFb/', 'Tinggal cekrek dapet hadiah?! Yakali nggak ikutaann~\n\nYang merasa anak skena sini merapaat! Ada photo challenge sama MODIS - Mobil Disko(n) nih buat kamu 😉 Caranya gampang banget 👇🏻\n\n1. Temukan Modis di kota kamu\n2. Share keseruan kamu bareng #GrabModis di Instagram & Twitter, mention 3 teman, @GrabID, dan gunakan hashtag #GrabModis\n3. Setiap minggunya akan ada 5 pemenang beruntung (total 30 pemenang), masing-masing mendapat @200k GrabGifts\n4. Periode Kegiatan: 24 Agustus - 1 Oktober 2023\n5. Jangan private akun Instagram & Twitter kamu ya 🔓\n6. Keputusan pemilihan pemenang merupakan wewenang Grab dan tidak dapat diganggu gugat\n\nTunggu apa lagi? Yuk Kejar MODIS, ikutan photo challenge bareng #GrabModis dan menangin hadiahnya! 💨\n', 654, '2023-08-23 09:46:10', 0.000682648, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3175624566207021403', 114, 0, NULL),
