(5385, '3174097459427435006', 'grabid', 14, 'https://www.instagram.com/p/CwMqNJ_pGH-/', 'Pada punya power apa sih? Kok bisa-bisanya kirim-kirim semuanya semaunya?\n\nMakanya, cobain deh langganan Paket Ongkir Unlimited GrabExpress, biar bisa rasain THE POWER OF LANGGANAN!\nGak main-main, kamu bisa dapet diskon s.d. 50% tiap kirim paket!\n\nCoba langganan sekarang, GRATIS!\n', 264, '2023-08-21 07:12:48', 0.000266659, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\grabid\\posts\\3174097459427435006', 36, 1, 3481),
