(13136, '3256139189940803068', 'lazada_id', 12, 'https://www.instagram.com/p/C0wIVdrplX8/', 'Gak nyangka udah 12 hari kita bersama 😖 Sekarang HARI TERAKHIR, loh, kamu bisa ke Lazada Fest 12.12 Pop-Up Festival LazHotel di The Space Senayan City Jakarta dan seru habis-habisan bareng bestie sambil belanja-belanja cantik! \n\n#LazadaFest1212 #SerunyaHabisHabisan\n', 255, '2023-12-12 11:55:05', 0.0000873398, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3256139189940803068', 29, 1, 5750),
(13137, '3256117254880183992', 'lazada_id', 12, 'https://www.instagram.com/p/C0wDWREJ0a4/', 'Kalo ada yang ngajak jalan, bilang aja SIBUUKKKK~ Sibuk main 12.12 #LazadaRebutHadiah dari pagi sampe malem ngajak temen dan menangin hadiah total 20M biar bisa belanja yang #SerunyaHabisHabisan 🫶\n', 141, '2023-12-12 11:10:46', 0.0000498206, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3256117254880183992', 21, 0, NULL),
(13144, '3255460476852901984', 'lazada_id', 12, 'https://www.instagram.com/p/C0tuA43JBhg/', 'Lazadians, kalo gejala kamu mirip Baba berarti obatnya cuma belanja di Lazada 😝 Sejak diobatin, sekarang #KeluargaAdaAjaALazan bisa jajan gemes tanpa mikirkirkir lagi~ Coba, bisikin mimin mana scene favorit kamu?\n', 2615, '2023-12-11 13:27:18', 0.000873398, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3255460476852901984', 225, 1, 88082),
(13145, '3255423033169154468', 'lazada_id', 12, 'https://www.instagram.com/p/C0tlgAtrBGk/', 'Buat Stellar yang di Jakarta dan Surabaya, are you ready for #LazadaFest1212 @lazada_id?!! 🙌\n\nPastiin kamu selfie, foto, dan rekam keseruanmu sebanyak-banyaknya yaa. Karena @stella.freshener udah siapin hadiah senilai total Rp10 juta untuk pengalaman Konser Happy, STELLAlu Wangi paling seru darimu!\n\n10 Stellar yang memenuhi syarat dan beruntung bisa menangin Light Stick Red Velvet, Light Stick SHINee, Album SHINee, Tumbler Corkcicle, Fujifilm Instax, atau Bluetooth Speaker JBL, lho! \n\nCaranya:\n1. Post foto atau video pengalaman #StellaluWangi kamu selama ngonser nanti. Bebas mau upload di Feed, Reels, atau Story IG kamu. Kalau di IG Story, ingat untuk simpan di Highlight, yaa! \n2. Tulis ceritamu di bagian caption. Ada momen gak terlupakan? Aroma yang bikin nyaman dan hepi? Boleh banget di-spill di sini!\n3. Terakhir, tulis hadiah yang pengen kamu menangin dan kenapa kamu pengen banget hadiah itu? \n4. Pastikan kamu sudah like postingan ini, serta follow dan tag @stella.freshener. Sertakan juga hashtag #STELLAluWangi #KonserHappySTELLAluWangi. \n\nMakin banyak yang Stellar post dan ceritain, makin besar kesempatan menangmu*! \nGiveaway ini berlangsung s/d 31 Desember 2023 jam 23:59 dan hanya berlaku untuk Stellar yang ikutan Lazada Festival 12.12 di Jakarta dan Surabaya. So, don’t miss it dan good luck!\n\n*Syarat dan ketentuan berlaku. Keputusan juri dalam menentukan pemenang dan hadiah yang dimenangkan tidak dapat diganggu gugat.\n #StellaluWangi #KonserHappySTELLAluWangi\n', 424, '2023-12-11 12:24:01', 0.000137468, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3255423033169154468', 23, 1, 7415),
(13148, '3255392336534102283', 'lazada_id', 12, 'https://www.instagram.com/p/C0tehUPpOEL/', 'Aduhhh.. Deg-Degan banget, nichhh, besok mau nonton Konser Musik Lazada Fest 12.12 di Surabaya dan Makassar! Lazadians, mana suaranya yang udah gak sabar seru habis-habisan?? 🎤✨ See you besok dan have fun bareng, guys~ \n\n#LazadaFest1212 #SerunyaHabisHabisan\n', 238, '2023-12-11 11:10:29', 0.0000744233, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3255392336534102283', 4, 0, NULL),
(13149, '3255275583342772053', 'lazada_id', 12, 'https://www.instagram.com/p/C0tD-VXJf9V/', 'Hayoo, pilih kanan atau kiri? Mimin kepo donggg kamu ini si paling apa kalo lagi main 12.12 #LazadaRebutHadiah 🧐 Coba komen, yaa, abis itu ajak temen kamu, main tiap hari dan menangkan hadiah total 20M yang pasti #SerunyaHabisHabisan!\n', 7776, '2023-12-11 07:18:31', 0.00239723, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3255275583342772053', 19, 0, NULL),
(13151, '3255253298183437295', 'lazada_id', 12, 'https://www.instagram.com/p/C0s-6CsJHvv/', 'Udah siapin apa aja nih buat besok? 😚\n\nSebelum besok kita seru-seruan bareng Raisa, Tiara Andini dan Maliq & D’essentials di Konser Musik Lazada Fest 12.12 Kota Makassar ~ pastikan kamu udah baca semua info penting di atas yaa! ✨\n\n#LazadaFest1212 #SerunyaHabisHabisan\n', 1101, '2023-12-11 06:34:14', 0.000532034, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3255253298183437295', 629, 0, NULL),
(13156, '3254533759921726710', 'lazada_id', 12, 'https://www.instagram.com/p/C0qbTYdpqT2/', '3 hari lagi! 🔥✨\n\nSiapin energi, semangat dan tiket kamu buat nyanyi dan seru-seruan bareng Rizky Febian di Konser Musik Lazada Fest 12.12 Kota Jakarta 🎤\n\nAda Red Velvet dan SHINee’s KEY juga loh!🥳\n\nBiar nggak kelewatan momen serunya,  yuk beli tiketnya di Aplikasi Lazada, TIX Events, Loket & Detik Events sekarang juga!\n\n#LazadaFest1212 #SerunyaHabisHabisan\n', 416, '2023-12-10 06:45:08', 0.000152845, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3254533759921726710', 81, 1, 6836),
(13159, '3253350598621710581', 'lazada_id', 12, 'https://www.instagram.com/p/C0mOSHopsj1/', 'Ngejar ayang udah biasa, ngejar tiket konser di Lazada Fest 12.12 Pop-Up Festival itu yang luar biasa 💖 Caranya gampang kok tinggal perhatiin cara kamu bisa ikutan challenge buat dapetin stamp dan ikutan undian tiket Konser Musik Lazada Fest 12.12 di 3 lokasi Pop-Up Festival!\n\n📍 Laz Hotel, The Space - Senayan City Jakarta\n📍 Laz Island, Ciputra World Surabaya\n📍 Laz Garden, Trans Studio Mall Makassar\n\nMeluncurrrr, dapetin semua stampnya, Lazadians~ #LazadaFest1212 #SerunyaHabisHabisan\n', 548, '2023-12-08 15:33:55', 0.000187903, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3253350598621710581', 63, 0, NULL),
