(13198, '3248109545995913942', 'lazada_id', 12, 'https://www.instagram.com/p/C0TmmxApErW/', 'WHAT’S UP SHAWOL INDONESIA!😍\n \nUdah siap nyanyi, joget dan seru-seruan bareng SHINee’s KEY? Atau udah siap terpukau liat SHINee’s KEY bawain Good & Great langsung?\n \nTapi udah punya tiketnya belum nih? Jangan sampai kamu kelewatan momen serunya di Konser Musik Lazada Fest 12.12 tanggal 13 Desember 2023 di Indonesia Arena Jakarta! ✨🔥🎶\n \n \nYang belum buruan beli tiketnya di Aplikasi Lazada, TIX Events, Loket & Detik Events sekarang juga!\n \n#LazadaFest1212 #SerunyaHabisHabisan\n', 1845, '2023-12-01 10:01:30', 0.000679343, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3248109545995913942', 364, 1, 27501),
