(13204, '3247928024790176152', 'lazada_id', 12, 'https://www.instagram.com/p/C0S9VSNp5GY/', '✨ GIVEAWAY ALERT ✨\n\nJadi betah dirumah kalo liat semua serba ✨ kinclong ✨ Gak bakal nyesel kalo dirumah udah nyetok @polkiindonesia yang pengen mimin kasih secara GRATIS buat Lazadians yang beruntung~ Cek caranya dan ikut giveawaynya di bawah, ya!\n\nSyarat & Ketentuan:\n1. Follow IG @Lazada_ID dan @polkiindonesia serta tag 3 teman.\n\n2. Komen apa jawabannya dan kasih alasan kenapa Lazada harus pilih kamu sebagai pemenang dengan Hashtag #LazadaGiveaway\n\nPeriode Giveaway: 1 - 7 Desember 2023. Pengumuman Pemenang: 9 Desember 2023 di IG Story @Lazada_ID. Lazada akan memilih 10 orang yang memenuhi syarat sebagai pemenang. Masing-masing pemenang akan mendapatkan Paket Polki Trio + Lap Microfiber*\n\n*S&K berlaku\n', 626, '2023-12-01 04:00:14', 0.000264172, 'C:\\Users\\nicho\\Documents\\8th Semester\\Thesis\\Advertisemement\\scraps\\lazada_id\\posts\\3247928024790176152', 233, 0, NULL),
